(4, 'Miguel Alejandro Núñez Delgado', 'kyrosnd@gmail.com', '0452223819043', 'A quien corresponda: \r\nFONARTE LATINO\r\n\r\nEl que suscribe, Miguel Alejandro Nuñez, Guitarrista egresado del Benemérito Conservatorio de Música del Estado de Puebla, se remite a esta casa productora para solicitar apoyo, con respecto a cuales son las políticas para formar parte de su sello discográfico, el fin último es aplicar a una Beca del FONCA para el ciclo 2018 el cual se concluirá con la evidencia fehaciente de la grabación de un Disco Compacto, el cual llevará por Titulo \"Nueva reunión antigua\" - (La guitarra Barroca en el antiguo y nuevo continente). Mi solicitud es si me pueden enviar en una hoja membreteada los detalles tanto de compromisos del solicitante como los costos que conlleva la grabación y producción discográfica. \r\nEl tema es hacer la grabación aproximadamente de 50 minutos de música del siglo XVIII del compositor Aragonés Gaspar Sanz y de Santiago de Murcia, éste ultimo se piensa que estuvo en México o que uno sus códices fue arribado a la Nueva España pues se encontró en Leon Guanajuato Mexico. Este repertorio se planea realizar con la siguiente instrumentación que en si misma es una combinación del viejo y nuevo continente: Quinta Huapanguera, Jarana Jarocha, Percusión y Guitarra Barroca.\r\nLes hago esta petición esperando contar con su amable y oportuna respuesta a este correo.\r\n\r\nSe anexa una liga del trabajo formal y profesional con el que se está proyectando el trabajo\r\nhttps://youtu.be/_bgzqMdeWbE\r\n\r\nGracias de antemano \r\nMiguel Alejandro Núñez Delgado\r\nPuebla puebla, México a 15 de Marzo de 2017', '2017-03-15', '00:00:15'),
