(310, 'Luis Alejandro Núñez', 'luisnunezmillan@gmail.com', '4151115247', 'Buenas tardes!\r\n\r\nEscribo de San Miguel de Allende, Guanajuato. Soy música, cantente y productor (tengo mi propio estudio de grabación pro) y me gustaría platicar con ustedes. Estoy buscando con quién hacer equipo para mover mi carrera. Busco algún label que haga también booking/management/eventos y pueda interesarse de trabajar juntos. Mi proyecto se llama \"Millán\" (mi apellido) y aunque no tengo un género muy específico oscilo entre el rock y el pop un poco y me enfoco mucho en las letras... Me gustaría enseñarles mi material y pudieramos platicar un poco al respecto. Dejo aquí un link con mi primer album: https://soundcloud.com/millanoficial/tracks\r\n\r\nActualmente me encuentro componiendo para un segundo album y pronto entraré al estudio. \r\n\r\nGracias por su tiempo!', '2017-10-23', '10:55:57'),
(311, 'JORGE ABRAHAM GUEVARA DUEÑAS', 'chichoantena@gmail.com', '3313448423', 'Hola un cordial saludo a quien corresponda fonarte latino.\r\n Mi Nombre Jorge Abraham Guevara D. \r\nsoy el dueño del grupo PLASTIKO y tengo mi hoja oficial y verificada para  eventos artísticos  y compositor y dueño de la marca también tengo la hoja certificada del disco de PLASTIKO -AMANCER FANTASTIK-autoria etc\r\nquien les autorizo para subir el disco a spotify ? y que nombre les autorizo ?\r\nya que tengo la insignia azul en spotify  con el Nombre PLASTIKO  y en que plataforma digital lo subieron ? es importante aterrizar el tema ya que es algo serio  para nosotros \r\nespero su llamado\r\nJorge Abraham Guevara Dueñas\r\nFUNDADOR de PLASTIKO', '2017-10-23', '12:46:43'),
