(314, 'Dante Toribio López', 'dantolodante@gmail.com', '5535773976', 'Buenas tardes.\r\n\r\nMi nombre es Dante Toribio López. La razón de este correo es para saber si hay posibilidad de que sean parte de los patrocinadores para un libro sobre rock.\r\n\r\nEste libro es basado entrevistas realizadas a través de correos electrónicos a personalidades de la talla del cantante pop Boy George, el periodista y biógrafo de Kurt Cobain Charles R. Cross, el primer mánager de The Rolling Stones Andrew Loog Olham y diversas personalidades más. Todas relacionadas al rock.\r\n\r\nTambién incluye algunas fotografías enviadas por los mismos entrevistados.\r\n\r\nLa editorial Libros del Marqués es la editorial encargada de este proyecto, por lo que se necesitan los fondos para comenzar con el trabajo.\r\n\r\nEl logotipo de FONARTE Latino aparecería en el libro, así como agradecimiento a ustedes y se dará distribución del mismo en ferias de libros, librerías especializadas, medios de comunicación, etc.\r\n\r\nSi están interesados en este proyecto y quisieran hablarlo más, mi celular es:\r\n5535773976.\r\nGracias. ', '2017-11-22', '13:13:20'),
(315, 'Mauricio Covarrubias', 'm.covablonds@gmail.com', '5510823797', 'Hola me gustaría pedir informes sobre como poder pertenecer con unos materiales discográficos a su disquera y sobre todo el que me agreguen el material en las plataformas digitales. Costos, ventajas, beneficios etc.\r\n\r\nSaludos\r\n\r\nMauricio Covarrubias', '2017-11-27', '14:50:40'),
