(317, 'josé Luis Domínguez Martínez', 'luiscosco@hotmail.com', '2731237220', 'Buenos días. \r\n\r\nLe escribe José Luis Domínguez Martínez, soy de la ciudad de Veracrúz, México, actualmente estoy trabajando en una organización sin fines de lucro, especialmente servimos a jóvenes estudiantes de muy bajos ingresos, son hijos de campesinos , se les ofrece educación, comida y alojamiento de forma gratuita. \r\n\r\nActualmente tenemos que poner el techo a un aula, ya que se usa  multipanel, ya que es un área muy fría. \r\n\r\nHabrá la posibilidad de que tengan algún tipo de programa de beneficio social o algo similar, donde puedan ayudarnos y así mejorar la atención y la capacitación educativa para estos estudiantes necesitados, que viven especialmente en las montañas. \r\nSi necesita datos, carta de presentación o cualquier otra información, estamos a su servicio. \r\nluiscosco@hotmail.com \r\nwhatsaap 2731237220 \r\nSaludos cordiales.\r\n', '2017-11-28', '17:50:02'),
