(320, 'siegfried Weyprecht', 'siegfried@ramshorn.nl', '0235292154', 'Hello,\r\n\r\nI?ll trust this finds you well.\r\n\r\nI am contacting you, cause it still looks like your catalogue is not registered for neighbouring rights in the Netherlands. We are collecting for more than 100 foreign companies successfully their Dutch neighbouring rights.\r\n\r\nI am interested in licensing your neighbouring rights for the Netherlands, we can collect your neighbouring rights for the claim periods 2014, 2015, 2016 & 2017.\r\n\r\nWould you be open to discuss licensing of neighbouring rights to Rams Horn Productions BV please?\r\n\r\nI look forward to hearing from you at your earliest convenience.\r\n \r\nKind regards,\r\n\r\n\r\n\r\nSiegfried Weyprecht          \r\nRams Horn Productions BV\r\nIr. E.J.J. Kuindersstraat 9 F5\r\n2041 AE Zandvoort\r\nThe Netherlands\r\nTel: 0031.23.529.2154\r\nE-Mail: siegfried@ramshorn.nl\r\nFounded: November 25th 1981\r\n', '2017-12-13', '06:15:32'),
(321, 'Alexis Caire', 'forseps00@hotmail.com', '5523055722', 'Hola,\r\n\r\nMi nombre es Alexis Caire, soy manager de la banda Rod-Fors, la nueva banda de Alfonso Fors (Ex-CUCA), estamos interesados en enviarles el Press Kit de la banda, así como algunos tracks de la misma.\r\n\r\nMe gustaría saber el mail de la persona correspondiente al que le pueda enviar esto y poder hacer una cita para platicar más acerca de Rod-Fors.\r\n\r\nPor favor, espero pronto su respuesta.\r\n\r\nSaludos!!!\r\n\r\nGracias.', '2017-12-14', '20:12:59'),
