(325, 'La Garrotera Cumbia Orquesta', 'lagarroteracumbiaorquesta@gmail.com', '3517533371', 'Córdoba, Argentina, diciembre de 2017\r\nHola! somos Seba  y Juani, músicos de La Garrotera Cumbia Orquesta, tenemos la intención de generar nuevos contactos, expandir nuestra música y presentarles  nuestro primer material discográfico editado en el 2017 de forma independiente,  llamado \"CumbiaTerapia\".\r\nHemos pensado en esta \"loca\" idea de formar lazos entre  diferentes actores de la cultura y la música fuera de nuestro país, con la ilusión de poder ampliar nuestro horizonte: Distribución de nuestro material, giras, eventos, etc.\r\nAquí les dejamos el link de nuestro disco y un video presentación que le da fundamento a nuestra obra.\r\nDisco\r\nhttps://www.youtube.com/watch?v=bXF-77vRmzg\r\nVideo\r\nhttps://www.youtube.com/watch?v=RPlqYVqTw0I&t=11s\r\nGracias por tomarse el tiempo para leer el mensaje y esperamos poder seguir contactándonos.\r\n', '2017-12-21', '18:32:41'),
(326, 'Emmanuel Nieves', 'emmanuelniera@hotmail.com', '7471067050', 'Favor de responder si se encargan de hacer maquila de una grabación, recientemente grabe un disco titulado \"Gozando mi Música\" con mi proyecto de latin jazz \"Emmanuel Nieves Quartet\" donde participo:\r\nEmmanuel Nieves (Piano)\r\nArturo Baez en el (Contrabass)\r\nMiguel Cruz (Percusión)\r\nEnrique Nativitas (Batería)\r\n¡Favor de responder a la brevedad!\r\n\r\n', '2017-12-27', '20:33:06'),
(327, 'Nikky Backman ', 'alexanderbackman8@gmail.com', '5559061666', 'Hola Diego te saludo con mucho gusto. Soy Nikky de Dragon y quería ver si me pudieras decir si me pudieras vender los discos que tienes en Dragon y me gustaría platicar contigo sobre otro tema que se está trabajando. Te mando un muy fuerte abrazo, muchas felicidades y quedo a espera de tus comentarios. \r\n\r\nNikky', '2017-12-29', '17:33:42'),
(328, 'Francisco G. Santillán', 'focosan_6@hotmail.com', '2464805433', 'Saludos desde Tlaxcala. Estamos terminando 2 discos, uno de música lírica y otro de música contemporánea. Quisiera saber si podemos distribuir a través de Fonarte latino ¿que se requiere? y ¿con quien podemos entrar en contacto para dudas y comentarios?\r\nDejamos el link de uno de los proyectos: https://youtu.be/w_p2M_C_JTE\r\nSin más por el momento quedo atenta a su respuesta.\r\nHaydé Patiño Rojas\r\nCoordinadora de \"Producciones Bogar\"\r\n2464805433', '2018-01-12', '11:34:36'),
(329, 'José Antonio', 'jos_6_5@hotmail.com', '2227609008', 'Hola, me permití escribirte, ya que te encontré en internet y me gustó tu disquera; por lo que quisiera ponerme en contacto contigo, ya que soy un compositor nuevo, con talento y con varias canciones que me encantaría que salieran a la luz y poder mover sentimientos en la gente, así como a mí me los movió al componerlas.\r\n\r\n\r\n¿Qué puedo hacer para que me ayudes a mover mis canciones y poder llegar a más gente? Por cierto, ya tengo 270 canciones registradas en Derechos de Autor.\r\n\r\n\r\nGracias por el apoyo y si quieres, te envío una prueba de canciones grabadas con guitarra en la computadora.\r\n\r\nSaludos', '2018-01-24', '10:28:37'),
