(335, 'Jorge Velázquez Torres', 'Trips_arno@hotmail.com', '4491648327', 'Buen día, mi nombre es Jorge Velázquez y me han hablado cosas muy buenas de ustedes referente al talento emergente, soy un MC de Aguascalientes con un concepto muy diferente a lo acostumbrado. Me encantaría que pudiesen escuchar algo de lo que hago, desde los 12 años me he dedicado al rap pero siempre en el anonimato y preparándome para ir mejorando. De antemano muchas gracias por la atención y espero que puedan escucharlo!', '2018-02-16', '09:36:17'),
