(338, 'Javier Mendoza', 'paquerestrella@gmail.com', '2227086498', 'Buen día\r\n\r\nSomos una compañía de mensajería, paquetería y carga ligera perteneciente al grupo Estrella Roja, ubicada en CDMX, Puebla y con representación a nivel NACIONAL .\r\n\r\nDamos servicio de mensajería y paquetería Extra Urgente entre CDMX y Puebla, teniendo disponibles sus envíos en el punto final entre 4 y 5 hrs. después de haber documentado en nuestros mostradores.\r\n\r\nServicio de paquetería, mensajería y carga ligera a nivel NACIONAL e INTERNACIONAL con una red de distribución capaz de dar el servicio con la mejor calidad posible. Contando en dicha red con alianzas que aseguran un servicio satisfactorio y puntual. \r\n\r\nTodo controlado por PAQUER.\r\n\r\nOjalá puedan darnos la oportunidad de hacer más extensa la información otorgándonos una cita y de este modo pueda conocernos y conocer nuestros servicios.\r\n\r\nSin más por el momento quedo a sus órdenes.', '2018-02-24', '08:50:57'),
