(342, 'Beto Cobos', 'robertocobos@hotmail.com', '2222170621', 'Hola mi nombre es Roberto Cobos, Beto Cobos soy musico guitarrista compositor. Estoy por sacar mi primer disco como líder , lo hice junto con Israel Cupich quien es mi amigo y fue quien me comentó de ustedes, aunque ya he sabido de su trabajo por años.\r\nEl motivo de acercarme a ustedes es conocer si les interesaría la distribución del disco, físico y en plataformas digitales. El genero es jazz contemporáneo, instrumental.\r\nAgradecería mucho si me contestan con alguna info al respecto ya que el disco esta en la ultima etapa de masterización y ya tengo el diseño del mismo también .\r\nMuchas gracias !\r\nATTE\r\nBeto Cobos', '2018-03-21', '14:19:14'),
