(346, 'aurelio', 'aurelioillera@hotmail.com', '6445989350', 'Estimado amigo:\r\n\r\nMe pongo  en contacto con usted para ofrecerle cuatro canciones compuestas por mi que podrían resultar  de su interés. Las canciones giran en torno a diferentes temáticas: la primera de ellas habla de Hispanoamérica y su riqueza paisajística y cultural, la segunda aborda el tema de las prohibiciones en la sociedad actual, la tercera es una parodia humorística sobre la brujería inspirada en las obras cervantinas y la última habla del amor bajo una perspectiva diferente e hiperbólica. \r\n\r\nPara más información puede visitar los siguientes enlaces:\r\n\r\nLLEVO DENTRO DE MI http://youtu.be/fTOyQ5oxds8 \r\nPROHIBICIONES http://youtu.be/hPifrE_aNgY \r\nLA CAMACHA http://youtu.be/e_DwC6aOimQ \r\nHASTA http://youtu.be/s9f_jjuNN24\r\n\r\n\r\nLes dejo mi contacto por si les fuera de interés:\r\n\r\naurelioillera@hotmail.com\r\nwww.composicionesillera.com\r\nSin otro particular, le saluda atentamente\r\n\r\nAurelio Illera \r\n', '2018-04-12', '16:17:36'),
