(348, 'Carlos Alberto Delgado Vizcarra', 'carldv7@gmail.com', '6862577465', 'Hola mi nombre es Carlos Delgado, vengo de Mexicali B.C, Soy economista y actualmente estudio Ing. en Audio en la Cdmx, cuento con experiencia en el área de producción de video profesional. \r\n\r\nBusco Integrarme a su equipo de trabajo pues su empresa es un referente a nivel nacional de como se deben hacer las cosas en un nuevo panorama musical.\r\n\r\nEspero tengan espacio ya sea laboral o como Becario, pues mi pasión es la música y mi objetivo es entrar en la industria y aportar lo mejor de mi para crecer en este negocio.   ', '2018-04-17', '09:02:11'),
(349, 'Lucia Castillo', 'tlachisqueproducciones@yahoo.com', '5532593251', 'Por este medio,  me permito presentar el trabajo profesional del músico San Cristobalense Julio Flores Bermúdez, para la presentación de su primer disco como solista titulado ?Música Tradicional Chiapanecas para guitarra solista?, mismo que fue logrado bajo la beca por segunda vez del PECDA, con el proyecto del mismo nombre del Lp, con el cuál realizó investigación, transcripción musical, arreglo, adaptación, elaboración de partituras, edición e interpretación de obras que forman parte del folclor chiapaneco. El resultado final fue un compendio de partituras de ocho arreglos para guitarra solista. La propuesta musical está basada en la fusión e integración de elementos de la música clásica y del jazz; (contrapuntos, cánones, técnicas de composición, orquestación, recursos tímbricos, técnicos, re-armonizaciones, ritmos especí?cos, modulaciones métricas, rítmicas avanzadas y técnicas extendidas), a algunos de los temas más representativos del folclor chiapaneco. Por lo mismo, solicito requisitos para ser parte del catálogo. Aquí su trabajo. https://www.youtube.com/playlist?list=PL_-mpFMw5z9LtoKCJ3-gVYci4SuboW6jA\r\nSin otro en particular, quedo en espera de sus amables comentarios.\r\nSaludos.\r\n', '2018-04-19', '10:04:15'),
(350, 'Erick Rodriguez', 'fermontsrocks@gmail.com', '6566060695', 'Hola Fonarte, mi nombre es Fabian, tengo una banda, nos llamamos \r\nFermont´s, somos de Ciudad Juárez, Chihuahua. Acabamos de sacar nuestro segundo material por cuenta propia.\r\n\r\nMi invitación es para que nos escuchen, aquí el link de una de las canciones recientes del album ´Hyperion´:\r\n\r\nhttps://open.spotify.com/track/6a7r0YPc5TveKbz62RRczt\r\n\r\nSi les interesa. nosotros gustosos de trabajar con uds. a futuro.\r\n\r\nTengan buen dia, \r\nErick-\r\n', '2018-04-20', '03:00:50'),
(351, 'RAMON ALFREDO ESCAMILLA JIMENEZ', 'empalador_producciones@hotmail.com', '5529444899', 'Buenas tardes hace ya poco mas de 2 años por medio de Ricardo Bravo se subieron 9 producciones mías las cuales nunca he recibido ningún pago de las ventas que se han generado.\r\nCon quien debo checar ese asunto y saber a ciencia cierta cuantas ventas se han realizado ?\r\nmuchas gracias por su amable atencion quedo en espera de su respuesta.\r\ngracias.\r\nRamón Alfredo Escamilla Jiménez.\r\n1. MAQUIAVELIA EL PERPETUO FESTIN\r\n2. MAQUIAVELIA RADIO FANTASMA 66.6\r\n3. MAQUIAVELIA LA AVENTURA ESPACIAL\r\n4. MAQUIAVELIA ANGUSTIENTES CUENTOS MALEVOLOS\r\n5. MAQUIAVELIA EL ENSAMBLE DE PESADILLAS\r\n6. ANABANTHA XV ANIVERSARIO\r\n7. ANABANTHA XVI ANIVERSARIO\r\n8. CORAZON OSCURO NEKROMANTIKO\r\n9. ROCK MONSTER VOL. 1', '2018-04-26', '16:05:40'),
