(360, 'Miguel Guerrero', 'miguelart07@yahoo.com.mx', '5531461505', 'Hola! Tengo una pregunta y un par de comentarios:\r\n¿Hay alguna tienda física donde pueda acudir a comprar algunos cd\'s? Me gustaría visitarlos.\r\nConsidero que es poco práctica la búsqueda de títulos.\r\nLa mayoría de los albums NO tiene descripción.\r\nTampoco está claro cuál es el formato que se está adquiriendo (cd, digital, vinil u otro).', '2018-05-21', '21:19:46'),
