(369, 'Oswaldo Baeza', 'baeza.o@yahoo.com', '8162555264', 'A quien corresponda:\r\nEstimado Fonarte Latino, escribo para pedir permiso de reimprimir un verso de la cancion \"A que le tiras cuando suenas mexicano.\" de Chava Flores. De forma no exclusiva para su uso en un libro electronico. El libro es auto-editado y auto-publicado y distribuido por internet. El tema de este libro es el de recalcar el transtorno de los ninos en un mundo sin aprecio a la educacion y la inversion en su futuro, en mexico como america latina. Tengo la impresion de que vos son los administradores de los derechos. Si no es asi, apreciaria cualquier direccion hacia tal administracion si es posible. El libro de relato corto electronico es en Ingles y sera publicado cuando sea permitido.  El precio seria de 0.99 centavos americanos, con descuentos y promociones de regalo. Podria proporcionar el verso y la traduccion a su gusto. Si es posible el permiso y cualquier cuota por licencia es muy apreciada. DIsculpen mi letra y mi espanol. Muchas gracias.\r\nOswaldo Baeza', '2018-06-05', '11:24:05'),
(370, 'steven', 'superchilo@hotmail.com', '6461781810', 'Hola, envíe correo con pago y datos de pedido 177', '2018-06-05', '16:08:13'),
(371, 'Rosa Maria Lopez Gonzalez', 'ousilopez@yahoo.com', '7224069464', 'Ya hice el deposito. No puse el # de pedido. BBVA..cajero 6455\r\nFecha 06/06/18  HORA: 16:03\r\nDeposito:$ 245.00\r\nComo envio copia del recibo de un cajero?\r\nCuando voy a recibir el CD?\r\n', '2018-06-06', '15:02:37'),
(372, 'Ernesto Lunagómez ', 'ernestolunagomez@gmail.com', '2281193223', 'Guitarrista y compositor mexicano, considerado por el ganador del Grammy Andrew York, y los compositores mexicanos Julio César Oliva y Ernesto García de León, como el guitarrista y compositor más importante de su generación en México. Su obra actualmente se estrena en países como: Austria, Italia, Suiza, Canadá, España, Tailandia, Indonesia, Venezuela, Brasil y México. \r\nCuál es la posibilidad o cuales son las cobdiciones para ser promovido por fonarte? \r\nwww.ernestolunagomez.com \r\n\r\nMuchas gracias. ', '2018-06-20', '13:05:33'),
(373, 'juan salcedo', 'jusanopal@hotmail.com', '5540708113', 'saludos mi nombre es juan salcedo de heavy nopal me interesa hablar con diego respecto a los pagos de explotacion en las plataferomas de nuestro disco ni unpaso atras  ya que no hmos podido localizarle favor de llamarme', '2018-06-29', '14:16:58'),
