(375, 'Dagoberto Enriquez', 'consulta_emd@hotmail.com', '9511140643', 'Quisiera haer un pedido de discos, pero no se como es la mecánica para poderlo realizar, me podrían proporcionar la información al respecto?\r\nGracias.\r\nSaludos.', '2018-07-16', '16:33:30'),
(376, 'Sophie Adelman', 'sa3534@barnard.edu', '3475879325', 'Hola! Me llamo Sophie Adelman y estoy el jefe del departamento latino en WKCR -- la estación estudiantil de Columbia University en Nueva York. \r\n\r\nSomos la estación más vieja de NYC y hemos trabajado mucho a mantener una biblioteca de música folclórica y ecléctica por todo mundo. También, tentamos a mostrar los artistas menos bien representadas en nuestros departamentos respectivos. En el latino, enfatizamos la música de los países hispanohablantes del Caribe, de Colombia y también de Brasil. Estoy como directora tentando a traer música de la America Central y la del tipo Tex-Mex a ser visto. \r\n\r\nAdmiramos mucho el trabajo que haza su sello y queremos nos involucrar en representar sus artistas en nuestra estación. Por eso, quiero preguntarse que hubieran algunas maneras en que podamos recibir promociones de su sello en los géneros de Cumbia, Boogaloo, Flamenco, Rumba, Electrónica, Mambo, Salsa, Tropicália, u otros géneros de la música latina? Además, hubiera artistas firmados a su sello quien están basados en Nueva York, o tienen un viaje acá y usted piensa que tengan interés en ser entrevistados por nosotros?   \r\n\r\nEstoy dando una conexión a nuestro website: https://www.cc-seas.columbia.edu/wkcr/ y también de nuestro departamento latino  https://www.cc-seas.columbia.edu/wkcr/departments/latin. \r\n\r\nMuchas gracias. Esperamos a leer su respuesta. \r\n\r\nSophie Adelman\r\nBarnard College \'19', '2018-07-17', '10:11:38'),
(377, 'Kimberly', 'info@nubemedia.com', '2722204552', 'Hola soy Kimberly.\r\n \r\nEn Nubemedia sabemos que Instagram se ha convertido en el escaparate de los profesionales de la comunicación, la interpretación y la moda.\r\n\r\nCon nuestros servicios podrás aumentar tu visibilidad global dentro de esta red social ampliando tu base de seguidores reales y conseguir así, contratos profesionales.\r\n\r\nContratalo a partir de 50$.\r\n\r\nPara más información  https://nubemedia.com/instagram-para-actores-y-actrices/ \r\n', '2018-07-18', '05:54:31'),
