(388, 'benedicto Aguilar ', 'escuchamosuncd@gmail.com', '5573399559', 'Escribe con mucho gusto Benedicto Aguilar arquitecto en marketing de la música  y me pongo en contacto con ustedes para compartirles el interés  de colaborar y ofrecer mis servicios en Fonarte estoy seguro que sumaria mi experiencia en esté gran proyecto.\r\n\r\nActualmente estoy lanzando mi plataforma beta de marketing parara artistas donde desde mi experiencia les platico  a los artistas o involucrados en la industria como aprovechar las nuevas herramientas para crear contenido y conectar con el fan desde la independencia. \r\n\r\nAquí  dejo  enlace. \r\nhttp://bit.ly/MARKETMUSICAL\r\n\r\nPor favor hacerle llegar está información a la persona correspondiente. \r\n\r\nGracias, y excelente día. \r\n\r\n\r\n', '2018-08-15', '10:39:42'),
