(395, 'Alejandro Morales Suárez', 'alexms90@hotmail.com', '2223031734', 'Buenas noches, mi nombre es Alejandro Morales Suárez y soy estudiante del Centro Internacional en Artes y Ciencias Cinematograficas, A.C. (CINEARTE) en Puebla. \r\n\r\nActualmente tenemos un cortometraje realizado en la institución, del cual soy director, y que en el cual queremos utilizar la canción \"Tierra Mestiza (con Introducción)\" para los creditos del mismo. Buscando sobre los derechos de esta canción me recomendaron hablar con ustedes sobre el asunto.\r\n\r\nAl ser un cortometraje universitario y sin fines de lucro, queremos saber si existe la posibilidad de una cesión de los derechos de esta canción. Al ser un producto de esta naturaleza se agradecerá con los créditos correspondientes durante los créditos del cortometraje, así como una copia en dvd del corto terminado. Le agradezco mucho su atención y espero su respuesta.', '2018-10-08', '19:16:43'),
(396, 'Lee Forester', 'forester@evialearning.com', '6163938803', 'A quien corresponda,\r\n\r\nLes escribo de la manera más atenta solicitando su permiso para publicar el texto de la siguiente canción:\r\n\r\nArtista: Amparo Ochoa\r\nCanción: La maldición de la Malinche\r\n\r\nEl uso previsto de la selección es el siguiente:\r\n\r\nTítulo: Rostros. Intermediate Spanish language and culture\r\nEditor: Live Oak Multimedia, Inc.\r\nTipo de Publicación: libro de trabajo (cubierta blanda)\r\n\r\nDerechos requeridos: el derecho no-exclusivo para publicar la selección en todas las ediciones del libro de cubierta blanda Rostros y en cualquier versión digital de la obra para su distribución en Estados Unidos y Canadá.\r\n\r\nColocación esperada en el libro: Las selecciones aparecerán como parte del Capítulo 1, que trata sobre la Identidad Mexicana y la Colonización. Aparecerá con apoyo didáctico y con letras en negrita para la ayuda del lector. El texto en sí aparecerá sin ningún cambio.\r\n\r\nNúmero estimado de copias impresas: 50,000\r\nPrecio esperado: $40.00 US\r\nPáginas: 140\r\nFecha estimada de la publicación: Agosto del 2019\r\n\r\nSolicito los derechos de autor para el editor Live Oak Multimedia, y para cualquier compañía que adquiera los derechos de este libro en un futuro. Les pido de la manera más atenta que revisen mi petición y me informen sobre los términos de los derechos de licencia, así como los créditos requeridos. \r\n\r\nLes agradeceré que me comuniquen si su compañía no posee los derechos de este título, o si necesitan más información de mi parte.\r\n\r\nMuchas gracias de antemano.\r\n\r\nCordialmente,\r\n\r\nLee Forester\r\n\r\nDr. Lee Forester\r\nLanguage Professor, Hope College\r\nPresident, Evia Learning Inc.\r\n720 E. 8th St. Suite 4\r\nHolland, MI 49423\r\nforester@evialearning.com\r\n616-393-8803\r\nwww.aufgehts.com\r\nwww.los-ritmos.com\r\n', '2018-10-09', '12:42:51'),
(397, 'Alejandro Morales Suárez', 'alexms90@hotmail.com', '2223831734', 'Buenas noches, mi nombre es Alejandro Morales Suárez y soy estudiante del Centro Internacional en Artes y Ciencias Cinematográficas, A.C. (CINEARTE) en Puebla. \r\n\r\nActualmente tenemos un cortometraje realizado en la institución, del cual soy director, y que en el cual queremos utilizar la canción \"Tierra Mestiza (con Introducción)\" para los créditos del mismo. Buscando sobre los derechos de esta canción me recomendaron hablar con ustedes sobre el asunto.\r\n\r\nAl ser un cortometraje universitario y sin fines de lucro, queremos saber si existe la posibilidad de una cesión de los derechos de esta canción. Al ser un producto de esta naturaleza se agradecerá con los créditos correspondientes durante los créditos del cortometraje, así como una copia en DVD del corto terminado. Le agradezco mucho su atención y espero su respuesta.\r\n\r\nEnvió de nuevo este correo pues me equivoque en un dígito de mi teléfono. lamento los inconvenientes', '2018-10-12', '11:10:40'),
(398, 'Juan Pablo Aispuro', 'pitayomusic@gmail.com', '5554523359', 'Estimados Diego Ávila y Pepe Ávila, me llamo Juan Pablo Aispuro, soy director de un estudio de grabación llamado La Casa del Árbol, donde producimos mucho material de jazz en la ciudad de México, me comunico con ustedes gracias a Alberto Medina que me pasó su contacto. Estamos por sacar un disco compilado de jazz mexicano que se llamará \"Sesiones en La Casa Vol. 02\" donde recopilamos de los mejores tracks que se han quedado guardado en el estudio de artistas que han venido con nosotros pero ese track no quedó editado en ningún disco, o se utilizó para una sesión de video, y también tracks de los últimos discos que han salido, y realizamos un disco de 12 tracks con muchos artistas de la escena nacional de jazz.\r\nes el segundo compilado que realizamos así, el primero solo se encuentra digitalmente, pero este segundo disco tengo muchas ganas de poderlo maquilar y darle una buena distribución con su respectivo apoyo en medios. \r\n\r\nArtistas Invitados: Alex Mercado, Marcos Milagres, Aaron Cruz, Diego Franco, Gerry Lopez, Roberto Verastegui, Alberto Medina, Roberto Sanchez Picasso, Cristian Galvez, Israel Cupich, Gustavo Nandayapa, Jahaziel Arrocha, Emmanuel Chopis Cisneros, Xuc Trio, Giovanni Figueroa, Pablo Prieto, Vladimir Alfonseca, Benjamin García\r\n\r\nAsí que quisiera poderme informar de cómo se puede hacer para estar en su catálogo y recibir su apoyo? espero que podamos trabajar juntos con este proyecto. Saludos Cordiales\r\n\r\nJuan Pablo Aispuro\r\nDir. Pitayo Music, La Casa del Árbol', '2018-10-17', '07:10:17'),
