(428, 'Iván García Quinto', 'ivan_g1q993@hotmail.com', '7772331503', 'Hola, buen día, quiero realizar la compra del CD de \"Los Folkloristas 45 años\" , solamente que no se a que horas llegaría al domicilio que seleccione,  o si me van a dar algún número de restreo, ya que no me encuentro en casa la mayor parte del día o ¿Puedo cambiar la dirección de envío? Me gustaría aprovechar para preguntar si hay manera de conseguir el álbum de \"Venezuela\" de Los Folkloristas igualmente.', '2019-06-01', '04:41:15'),
(429, 'Julian', 'info.upmanagement@gmail.com', '2323606388', 'Hola Cómo andan? Mis más cordiales saludos a toda la producción del programa!\r\nSomos un sello independiente que incluye a varios proyectos y la verdad son muy interesantes! \r\n\r\nEn este link van a encontrar material online de cada artista y una carpeta de Drive pública con la música de cada banda/solista.  Van a poder descargarla para rotarla en el programa o evaluar de forma más completa las propuestas\r\n\r\n\r\nMúsica de cada proyecto: https://linktr.ee/upmanagement_ok\r\n\r\nDesde ya, los artistas y/o bandas que les interesen para el programa no duden en ponerse en contacto así coordinamos la entrevista! \r\n\r\n\r\nMuchas gracias por el apoyo a la música emergente! \r\n\r\n\r\nSaludos!\r\n\r\n\r\nJulián\r\nUP Music Management\r\nContacto: https://wa.me/5491126684778', '2019-06-17', '11:16:32'),
(430, 'Miguel Guerrero', 'miguelart07@yahoo.com.mx', '5531461505', 'Hola!\r\n¿Hay venta directa al público en sus intalaciones de General Anaya?\r\nEn caso de que así sea, ¿Los precios son los mismos que en la tienda en línea?\r\nGracias, quedó en espera de su amable respuesta. Saludos cordiales.', '2019-06-23', '21:34:38'),
(431, 'Ricardo León', 'lamanchavoraz666@hotmail.com', '4721613369', 'Hola. Saludos. Me acabo de suscribir a este medio. Me interesa comprar discos de su catálogo en formato físico. Antes de cometer algún error me gustaría que me explicaran la manera o maneras de poder comprar y de que me los envíen. Vivo en provincia. Muchas gracias.', '2019-07-23', '22:52:04'),
(432, 'Christian', 'chtorrez@yahoo.com.mx', '5568053015', 'Hola! Deseo adquirir varios discos con ustedes, intenté comprarlos desde su página pero no me da la opción de pagar via paypal o transferencia bancaria. Me gustaría comprarlos personalmente ¿a donde me puedo dirigir? ', '2019-07-30', '11:22:04'),
(433, 'Israel Sánchez González', 'tumbaomx@yahoo.com.mx', '5518792247', 'Estimados amigos:\r\nSoy el compositor de la pieza \"Yasi Suite\", grabada en el disco del grupo \"Sattva 0101\". \r\n¿Me es posible compartir fragmentos de dicha pieza en la plataforma de Soundcloud?\r\nGracias.', '2019-08-09', '18:18:51'),
(434, 'Cecilia Rodríguez', 'productora.ceciliarodriguez@gmail.com', '5572626093', 'Buen día. Quisiera información respecto a sus servicios\r\nNosotros somos un grupo de música típica mexicana y estamos próximos a grabar nuestro tercer disco con temas navideños\r\nMe gustaría preguntarles si ustedes se dedican a la distribución o también tienen grabación y/o maquila.\r\nY en dado caso de que sea sólo distribución, cuál o cuáles son los requisitos para poder pertenecer a su sello discográfico. En caso de los demás servicios, costos y requisitos de los mismos \r\nAgradezco sus atenciones y quedo atenta a su amable respuesta', '2019-08-19', '17:02:32'),
(435, 'Ruben Forero', 'rubenbossanova@hotmail.com', '3112897077', 'Hola, mucho gusto soy Ruben Forero un artista Colombiano, actualmente estoy grabando una versión de una de las canciones de su catalogo, la canción es \"BASTA\" de \"CARLOS MACÍAS\" y quisiera saber que requisitos tengo que tener para poder publicarla en plataformas digitales. \r\n\r\nEl lanzamiento está planeado para la tercera semana del mes de septiembre 2019, Un Abrazo y quedo muy atento a su respuesta. \r\n\r\nGracias. ', '2019-08-29', '10:24:01'),
(436, 'Emmanuel León', 'emmanuel.leon.senado@gmail.com', '9512756732', 'Saludos, estoy tratando de contactar con Virulo. \r\nQuisiera comentarle de un proyecto en el que se contempla integrar su canción \"La milonga del desafuero\".\r\n\r\nGracias por su atención.', '2019-09-11', '08:35:47'),
