(439, 'Pamela Nuñez', 'pamela@totemmusica.com', '5540905232', 'Estimados, \r\nMe presento, soy Pamela Nuñez y trabajo en Totem Música con el supervisor musical Mauricio (Gonzo) Arroyo.\r\nNos interesa la obra Chilanga Banda, del disco Más de Jaime López & José Manuel Aguilera para una producción mexicana.\r\n¿Podrían proporcionarme un correo electrónico o un mail para mandarles los detalles?\r\nQuedo atenta a su respuesta, muchas gracias!\r\nPamela ', '2019-09-18', '18:22:04'),
(440, 'Juliana Velasco', 'julianavelascoamado@gmail.com', '3144370457', 'Hola! He estado escuchando con mucha emoción el álbum que acaba de lanzar Regina Orozco junto a Omara Portuondo, pero creo que existe una inexactitud: en los créditos de la canción \"Dos Gardenias\" aparece como compositor Álvaro Carrillo pero la compositora es Isolina Carrillo.\r\n\r\nGracias por su trabajo!\r\n\r\nSaludos.', '2019-10-22', '13:49:28'),
