(443, 'Nico Flores', 'flores_1691@outlook.es', '7221461944', 'Buenas noches, hace algunos años les envié algunas melodías de un servidor para solicitar el apoyo de promocionarme y ser distribuidas, solo que me dijeron en ese entonces que tenái potencial pero que necesitaba fueran mas \"producidas esas melodías. y Hoy me atrevo nuevamente a pedirles ese apoyo. Les envío los liks para que me escuchen por youtube. Muchas gracias y espero su atenta respuesta:\r\n https://www.youtube.com/watch?v=ngNCbjlrlPU\r\n\r\nhttps://www.youtube.com/watch?v=I5PTRwCCif0\r\n', '2019-11-02', '00:07:07'),
