(446, 'Ulises Leonardo', 'esleonardo@yahoo.com.mx', '5529153749', 'Hola Buen dia.\r\nMe gustaria saber si en la dirección que aparece aquí (Calzada General Anaya 55 ? 2A, San Diego Churubusco 04120 México D.F.), venden libros, discos y DVD´s o solo son sus oficinas en la CDMX.\r\nSaludos', '2019-11-21', '09:32:00'),
(447, 'Ayan', 'ayansounds@gmail.com', '9841405216', 'Hello,\r\n\r\nMy name is Ayan. I am a music producer, live looping artist, and multi-instrumentalist. I have collaborated with artists such as Nicola Cruz and worked as a resident musician in Ibiza and in Tulum, in Nomade, Habitas, Azulik, and Beachouse. \r\n\r\nI am writing to you as I would like to show you my music. I have recently finished mixing an album that contains a mixture of all the things I like. For this reason, I am not able to categorize it in one genre only. I like making music, anything that interests me at that moment. This album contains influences from pop, rock, electronic, dance, Latin music with the attempt of transmitting something useful to the audience: a message of freedom and uniqueness.\r\n\r\nBelow you can find a link to a streaming Soundcloud link:\r\nhttps://soundcloud.com/ayansound/sets/unique-soul_mixes/s-c39Hp\r\n\r\nYou can also find my Electronic Press Kit here:\r\nhttps://drive.google.com/open?id=1-17rKkmS_3h5QdGQwCI_iEHFu_jOs0An\r\n\r\nI hope you enjoy it. And I can receive some feedback from you.\r\nThanks,\r\nGreetings,\r\nAyan', '2019-11-22', '07:43:43'),
(448, 'Alex Cavic', 'jimenez.alejandromx@gmail.com', '9981040788', 'Hola, solo los mas valientes le dara click al link\r\ny solo los mejores oidos escucharán la canción hasta el final\r\n\r\nhttps://www.youtube.com/watch?v=M-9TIbuvlHI\r\n\r\nsoy Alx Cavic cantautor originario de Cancún.', '2019-11-30', '10:31:42'),
