(455, 'Javier Garcia', 'j.garcia.e1987@gmail.com', '7775648052', 'Hola buenas tardes Diego, <br>Soy Javier, el programador que desarrollo tu sitio,  solo te escribo para saludarte y ofrecer mis servicios de programacion en cuanto a desarrollo de nuevos sitios o mantenimiento de tu sitio.<br>Veo que el sitio esta funcionando bien, sin embargo, las tecnologias siguen avanzando y seria bueno no dejar obsoleto tu sitio.<br><br>Feliz anio, Saludos.', '2020-01-14', '12:26:53'),
(456, 'Mario G. Iglesias / Cantautor', 'metalx_metal@hotmail.com', '5530183350', 'Hola,\r\nFonarte Latino\r\n\r\nSoy compositor mexicano emergente. Me permito compartir con ustedes tres enlaces de Soundcloud con temas de mi autoría afín de ponerlos a su consideración para aplicar en su sello, catalogo y/o distribución.\r\n\r\n-Track 1 / \"Te Doy Mis Alas\"\r\n\r\nhttps://soundcloud.com/mario-saize/te-doy-mis-alas\r\n\r\n-Track 2 / \"Has Sido Tú\"\r\n\r\nhttps://soundcloud.com/mario-saize/has-sido-tu\r\n\r\n-Track 3 / \"A la Luna\"\r\n\r\nhttps://soundcloud.com/mario-saize/a-la-luna-1\r\n\r\n-Sitio Oficial y Biografía: \r\n\r\nhttp://mariosaize.com/biografiacutea.html\r\n\r\nAgradeciendo de antemano su atención quedo a sus órdenes.\r\n\r\nSaludos.\r\n\r\nMario G. Iglesias\r\n(Mario Saizé)\r\nCorreo: metalx_metal@hotmail.com\r\nMóvil y WhatsAPP: +52 01 5530183350\r\nTwitter: @MarioSaize\r\nInstagram: mario.saize\r\nFan Page: @MSaize\r\nCiudad de México, Mex.', '2020-01-22', '11:24:38'),
