(458, 'Iván García', 'ivan_g1q993@hotmail.com', '7772331503', 'Buen día, me gustaria saber si tienen en existencia física los siguientes CDs de el grupo Los Folkloristas: 1_Bolivia, 2_México: Horizonte Musical, 3_Coplas y Tonadas, 4_Rondador Ecuatoriano (con Arturo Aguirre). Supuestamente no están en formato físico en la pagina pero hace tiempo compre unos discos con ustedes y el CD de Venezuela también aparecía como si no lo tuvieran en físico y después de ponerme en contacto me corroboraron que si lo tenían. Gracias.', '2020-01-25', '21:53:49'),
(459, 'Eduardo Noguera', 'eduardo.noguera@gmail.com', '(03) 5334 4570', 'fonarte,\r\n\r\nOK, I_ve always wanted to be Instagram-_big_, too.\r\n\r\nWell, today I will teach you the best way to totally improve the way you Instagram.\r\n\r\nNow, imagine that it is Friday and you\'ve just woken up from a sound slumber.\r\n \r\nRoll over, check your cell. \r\n\r\nClick the Instragram App. \r\n\r\nYouare surprised at what you see: Over 652 likes on a single one of your pictures! There, you see a flurry of likes on your pictures--over 832 on a single photo alone.\r\n \r\nYou rise out of the warmth of your bed, meander to the kitchen. You want a drink, so you put the kettle on for some tea, and check Instagram again.\r\n\r\nPresto! Another 87 likes. \r\n  \r\nDing_another message pops into your inbox from a follower. They\'re asking you for advice on how you manage your food, and are congratulating you on your third month of hitting the gym.\r\n\r\nThe kettle blows and you pour your tea. When you flip out your phone, there\'s another message--this time from a young girl--thanking you for posting. She follows you religiously and you are an inspiration.\r\n \r\nAs you sip your tea, you start typing up a response. But then your cell buzzes.\r\n\r\nHmmm, ANOTHER message. You close your cellphone and throw it in the bag. Time for the gym.\r\nListen, fonarte, most people just are not in control of their life. Seriously, they can_t even get themselves to have a balanced breakfast, much less hit the gym.\r\n\r\nNow, this is the point in time where you learn to take control of your Instagram.\r\n\r\nNow, what if you raised your popularity by 100%, or 1000%?\r\n \r\nIt\'s not difficult to do, although almost no one does. Just check out our website. There, you\'ll learn how to garner Instagram followers and likes like mad...without even trying.\r\n\r\nIn just minutes after posting, we get your images piled with likes.\r\n\r\nIf you are anything like our other clients, you will have a great chance of hitting the \"Top Post\" section in a very short time.\r\n\r\nSound too good to be true? Here_s what you have got to do to get a taste:\r\n1. Click https://jabbertune.online\r\n2. Enter in your Instagram username.\r\n3. 10 - 15 likes are going to be sent to your three most recent uploads. Just like that.\r\n\r\nHitting the Top Post page will 10X your InstaGrowth. But you have got to do more than just want it--you have got to do something about it. Are you willing?\r\n\r\nChow until next time', '2020-02-01', '13:46:26'),
