(462, 'Ivan García Ugalde', 'ivangarciadrums@gmail.com', '5536048306', '¡Muy buenos días!\r\nMi nombre es invan García, 2o. Baterista de Arpía (Cecilia Toussaint).\r\n¿Quisiera saber si puedo conseguir directamente con ustedes algunas copias del álbum Arpía 25 años?\r\nYa que me sirven como currículum.\r\nDe ante mano agradezco su tiempo y quedo a sus órdenes.\r\nAtte. Iván García\r\nBaterista ', '2020-02-04', '09:11:40');
