(463, 'Juan Pablo Aispuro', 'contacto@pitayomusic.com', '5554523359', 'Saludos, soy el director de un nuevo sello de Jazz llamado Pitayo Music, contamos con un catálogo de discos de Jazz que nos gustaría buscar la manera de distribuir físicamente y nos gusta e interesa mucho su trabajo. Tenemos artistas como Alberto Medina, Roberto Sánchez Picasso, Flora Pasquet, Luri Molina, Christian Mendoza & The Mexican Cats, Roberto Verástegui , Albums Compilados con la participación de más de 20 artistas de la escena de jazz entre otros. Les agradezco mucho la información\r\nles dejo nuestra página web\r\nwww.pitayomusic.com \r\n\r\nAtt. Juan Pablo Aispuro.', '2020-02-07', '09:33:00'),
