(492, 'Miguel Vilchis ', 'miguelvilramis@gmail.com', '5542861427', 'Hola, soy estudiante de Historia en la UNAM, estoy realizando una investigación acerca de la Nueva Canción en México, debido a esto realice una entrevista a Pepe Avila hace unos meses donde me refirió que Fonarte Latino posee el acervo de discos tanto de Disco Pueblo como de Nueva Cultura Latinoamericana, sin embargo no encuentro es su pagina los catálogos quisiera saber si hay forma de consultarlos o incluso de que pudieran enviármelos por correo lo cual me serviría para la investigación como para hacer compras de los discos que requiera en caso de que los precise. De antemano les agradezco su atención. ', '2020-06-25', '11:47:12'),
