(500, 'Gerardo De Marco', 'hablemos@yomtune.com', '1155680570', 'Saludos desde argentina, mi consulta es por el compilado que uds tienen distribuyendo, llamado RAP LATINO, dicho compilado en su momento de creación fue impulsado y dirigido por el sello español La Sierra, yo soy dueño del master de el track de Apolo 11, (a su vez miembro de esa banda), en el momento de creacion del proyecto se dividió la distribución en cada pais, y nosotros teniamos la distribución para argentina, mas alla de eso en el año 2003-2004 no existía nada de los servicios de streaming etc, bien no se como resolvieron uds gestionar ese master en streaming, voy al punto de que en principio corregir toda la info de ese track, y ver de reemplazar las licencias que uds utilizand por las mias. ese track pertenece a un album nuestro llamado ?show del flow? del año 2003.\r\nno me interesa ningun tipo de conflicto. simplemente poner a regla todo. ', '2020-07-21', '08:58:57'),
(501, 'Eduardo Bortolotti', 'bortolotti.eduardo@gmail.com', '2212177444', 'Buenos días,\r\n\r\nMi nombre es Eduardo Bortolotti Lopez, violinista de jazz. Actualmente me encuentro residiendo en Polonia, lugar donde he grabado junto con mi grupo, temas y arreglos originales. Mi música aparte de entrar dentro de los estándares de jazz contemporáneo, incluye elementos de música folclórica mexicana (música veracruzana e instrumentos prehispánicos) ya que siempre fue parte de mi formación musical. \r\n\r\nActualmente tengo el material grabado ( en Studios Jazovia.pl,  Gliwice) y aun estoy en proceso de masterización. La formación e integrantes del grupo es la siguiente:\r\n Bajo - Edi Sanchez (Colombia)\r\n Piano - Mateusz Sobiechowski (Polonia)\r\n Batería - Bartek Staromiejski (Polonia)\r\n Jarana - Albert Suazo (Mexico)\r\n Composicion y Arreglos / Violín - Eduardo Bortolotti (Mexico)\r\n\r\nSinceramente me gustaría contar con el respaldo institucional de un sello discográfico y distribuidora de calidad como lo es Fonarte Latino. Por lo que me gustaría establecer contacto con ustedes para saber mas sobre sus políticas de trabajo y de ser posible mostrar mi proyecto para llegar a un eventual acuerdo.\r\n\r\nDe antemano muchas gracias,\r\n\r\nEduardo Bortolotti\r\n(+48) 535 701 320\r\n(+521) 2212177444 (solo whatsapp)\r\neduardobortolotti.com', '2020-08-07', '01:09:05'),
(502, 'Fernando Moran', 'tribucausa@msn.com', '8056988123', 'Hola, \r\nSoy un investigador de la nueva canción mexicana y estos escribiendo unos textos referentes a las compañías discográficas independientes. En el caso de Discos Pueblo tengo información incompleta. Podrían por favor enviarme el catalogo. \r\nMuchas gracias.\r\nMi blog acerca de la nueva canción es el siguiente\r\nhttp://lanuevacancionmexicana.blogspot.com/\r\n\r\nFernando Morán\r\nCalifornia\r\nAgosto 8, 2020', '2020-08-08', '17:32:25'),
(503, 'Pedro Vazquez', 'cosmico2002@hotmail.com', '8312240413', 'Hola,\r\n\r\nTuve unos problemas al hacer la orden y se canceló. Trataba de ordenar 2 vinilos de Sufro, Sufro y Sufro y 1 CD de Animanesia de San Pascualito Rey.  Se cerro la ventana y no pude ver los detalles, no sé si se tramitó la orden o no.  Me podrían dar mas información para proceder o una confirmación del estado de la orden por favor?\r\n\r\nMuchas gracias.\r\n\r\nPedro Vazquez ', '2020-08-08', '19:49:29'),
(504, 'Paula', 'cambronpaula88@gmail.com', '4421202349', 'Buenas noches \r\n\r\nMe gustaría saber si es su catalogo tienen un lp de Ester Echeverría titulado \" Ester ...Su voz\" en donde entre otras canciones están el Son de la tortuga y La lavandera es del año 1984 .\r\n\r\nMuchas gracias de antemano .\r\n\r\nPaula Cambron \r\n', '2020-08-14', '17:55:23'),
