(506, 'Lindsay Johnson', 'lindsayjohnson0086@gmail.com', '444-555-6666', 'Hi,\r\n\r\nI hope you are doing well.\r\n\r\nI want to contribute a guest post article to your website that may interest your readers. \r\n\r\nIt would be of high quality and free of cost. You can choose the topic of the article from the topic ideas that I\'ll send you in my next email once you approve this offer. \r\n\r\nPlease note that I will need you to give me a backlink within the guest post article.\r\n\r\nPlease let me know if I shall send over some amazing topic ideas?\r\n\r\nRegards,\r\n\r\nLindsay Johnson', '2020-08-21', '01:09:35'),
(507, 'David', 'david_carmona_retamar@hotmail.com', '0605460191', 'Buenos días, queríamos saber que precio tienen los derechos de autor del tema que creemos es de su propiedad: \"Nos Tienen Miedo\" de Liliana Felipe por Orchard Music. Se ha utilizado en algunas manifestaciones profeministas aquí en España y queríamos incluir esos sonidos captados en el documental \"Mujeres supervivientes\".\r\nGracias.', '2020-08-28', '03:15:56'),
