(512, 'Rodrigo Raschiani', 'rodrigo-rh@outlook.com', '1123116460', 'A quien corresponda:\r\n\r\nLes escribo porque ustedes tienen en su catálogo 2 discos de NACHA GUEVARA:\r\n\r\nNacha Guevara en Vivo de 1975\r\nNacha Guevara Canta a Benedetti de 1976\r\n\r\nQuería pedirles si pueden pensar en la posibilidad de armar entre ambos; un COMPILADO por los 80 AÑOS de NACHA NGUEVARA.- Este 3 de OCTUBRE ella está cumpliendo esta edad y sigue activa y cantando.-\r\nSería genial poder tener esto simplemente como DISCO ONLINE en las Plataformas Digitales.-\r\n\r\nTal vez puedan armar algo así como les paso como idea:\r\n\r\nYO SOY LA NACHA\r\nDE QUÉ SE RIE?\r\nTODAVÍA\r\nVOS LO DIJISTE\r\nLAS DAMAS DE BENEFICIENCIA\r\nLA BALADA DEL EMPLEADO NUEVO\r\nYO SOY LA SECRETARIA\r\nMI HOMBRE\r\nGUARDERIA\r\nAQUÍ NO HAY CIELO\r\nYO TE NOMBRO\r\nSOY SNOB\r\nVIDALITA POR LAS DUDAS\r\nVERSOS SENCILLOS\r\nCUANDO TE JUBILES\r\nLA MUCAMITA\r\nAMOR DE TARDE\r\nVAMOS JUNTOS\r\nTE QUIERO\r\nVALS DEL MINUTO\r\n\r\nLo que hice fue mezclar las canciones de ambos discos; dejando de lado los audios que son solo presentaciones habladas.-\r\nPara que sea un álbum más fluido.-\r\n\r\nSi quieren yo puedo diseñarle una PORTADA usando alguna de las fotos que tienen los LP.-\r\nPOR FAVOR SEAN BUENA ONDA!\r\n\r\nNACHA GUEVARA merece un NUEVO DISCO COMPILADO y ustedes tienen los audios más escuchados en SPOTIFY.-\r\nSaludos cordiales\r\nRodrigo\r\n', '2020-09-29', '09:56:53'),
(513, 'Gemma Webster', 'licensing@wrdmusic.com', '0207267676', 'Dear Sir/Madam, \r\n\r\nWe found your contact details on the net.  \r\nWe are an established Indie label in London and licence most of our tracks from other Indies and Majors (such as Universal/Sony/WMG etc.)\r\nWe compile and produce CD albums for Ballroom dancing, which we market to dance schools, dance clubs.\r\nOur new 2CD project will be titled ?Very Ballroom 7?\r\n\r\nWe are interested to licence and use the above/below track which we understand copyright may belong & be controlled by your Company?\r\n            1. ?Perfidia? by Big Band Jazz de Mexico\r\n    ( from the album ?Big Band Jazz de Mexico and Friends? (p&c) 2017)\r\n\r\nCould you please check and confirm if indeed your Company control the copyright of this recording, so we can then put in writing a proper licensing request. \r\nPlease provide us with the contact details (email etc..) of your licensing colleague. Or if this copyright is not controlled by you please let us know who may be the best rightful contact ?\r\n\r\nWe thank you in advance for your early and favourable reply ,\r\nmany thanks & regards,\r\nlicensing@wrdmusic.com \r\nGemma Webster\r\nLicensing Enquiries\r\nWRD Music Ltd, United Friendly House, 282 Camden Rd, London NW1 9AB\r\nTel: +44 207 267 6762  fax: +44 207 482 4029\r\n', '2020-10-08', '04:32:25'),
