(515, 'Jonathan Totena', 'musicarpajt@gmail.com', '2281610608', 'Buenas tardes, mi nombre es Jonathan Totena soy músico folclórico de Colombia, actualmente estoy viviendo en México y he visto las producciones que ha sacado fonartelatino y quisiera saber cuales son los requisitos para trabajar con ustedes o como se manejan, si pudiera brindarme la información por favor.\r\n\r\ncomparto los link de la producción que acabo de realizar en mi casa, de ahí su nombre, Hecho en Casa\r\nhttps://open.spotify.com/artist/6YaCUaiNxxBxPWwGBbZVTx?si=yU0DMLXPSlCVpNeVsJ2TmA\r\n\r\nhttps://www.youtube.com/channel/UCZhtFM3qepxUIFL7rNwFDnw?view_as=subscriber\r\n\r\nDe antemano muchas gracias por la atención prestada y esperando una pronta respuesta.\r\n', '2020-10-16', '10:39:28'),
(516, 'Marc Rodamilans', 'dedorec@hotmail.com', '2105491434', 'Diego,\r\nNo se si me recuerdes, soy hermano de Enric Rodamilans y he estado tratando de contactarte, me es dificil por el hecho de que resido en San Antonio, TX.\r\nEs sobre algunos discos que se publicaron atravez de ustedes de mi sello \"discos Dedo\" hace un par de decadas o mas. Necesito hablar con ustedes de manera que podamos \"liberar\" todo este material de las redes. Son varios Cds, entre ellos 2 acoplados con titulo Sin Alternativa (1 y 2), el de los grupos Funkswagen, Las Bailarinas, 600 A.C., Escarbarme y algunos mas que podria poner en una lista si lo requieren. Algunos de estos fueron publicados originalmente por Opcion Sonica o SUM, o discos Dodo en conjunto con discos Dedo. Todas esas grabaciones, las hice yo personalmente asi como la produccion, o en colaboracion con Carlos Walraven.\r\nLos grupos mismos quieren manejar este material en las redes, y tanto Youtube como otras plataformas estqan ya sea bloqueandolo o marcandolos como infraccion de Copyright. Yo tambien he tenido este problema con varios de los CDs de bandas que grabe y produje y que estamos tratando de re-editar. Los acoplados de Sin Alternativa son los que mas problema nos estan dando ya que una cancion de cada uno de estos grupos esta incluida.\r\nLes agradesco mucho de antemano, y espero que pronto podamos comunicarnos directamente.\r\nGracias,\r\nMarc Rodamilans.\r\n\r\nPD. mi numero es 2105491434 (San Antonio TX)', '2020-10-26', '12:37:44'),
