(555, 'tag (Nombre Artístico: Perro Zw)', 'manicomioclan@gmail.com', '5537899363', 'Hola, excelente tarde, me presento soy Enrique Zwittag, soy artista de Hip-Hop de la CDMX mi nombre artístico es Perro Zw. Les dejo mi link de Spotify al final. \r\nEstaba buscando música del Maestro Armando Manzanero y así fue como llegué a su página, me dio curiosidad checar su catálogo en la sección de géneros, a ver si tenían algo de Hip-Hop, y me di cuenta de que todos los álbumes que tienen ya son bastante antiguos, me gustaría saber porque? si dejaron de trabajar con artistas de Hip-Hop y Rap, o que paso? y si no les interesaría conocer las propuestas de algunos artistas que estamos empezando a posicionarnos dentro del género ya con algunos años de trayectoria y experiencia que respaldan los números, además de un servidor \"Perro Zw\" trabajo con varios artistas más, y conozco o puedo conectarles directamente con algunos otros para que puedan ampliar su catálogo, y porque no quizá trabajar o colaborar juntos en algo o algún proyecto. De mi parte ya tuve la oportunidad de rapear en 2 festivales \"Vive Latino\", entre otras cosas como experiencia y conozco a algunas personas dentro del ambiente musical que respaldan nuestro trabajo. Los saludo con mucho respeto y espero puedan al menos aclarar mi duda del porque manejan un catálogo de Hip-Hop y Rap tan antiguo, cuando ahorita el Hip-Hop Mexicano está en su apogeo con cientos de exponentes que están posicionando dentro de las grandes plataformas como Spotify, Youtube, y en general de la industria. Ojalá pronto puedan ampliar ese catálogo, tienen música muy interesante de todos los géneros, incluyendo también esos discos antiguos de rap que ya tienen, pero no estaría mal que tuvieran algo más actual. Saludos y gracias. \r\nLink de Spotify: \r\nhttps://open.spotify.com/artist/7CPuRgoqujB5wHULxqiIqv?si=JWeLgxEoTxWncswxxKv1_w\r\n', '2021-02-24', '10:00:49'),
