(595, 'Jonathan Moret -  (aqui no) records', 'aquinodisquera@gmail.com', '5550303746', 'Hola buenos días/tardes/noches.\r\n\r\nMe gustaría presentarme. Soy Jonathan Moret, label manager de Aqui No Records. Les escribo este mensaje solicitando permiso para usar un sample de un tema que ustedes poseen licencia. El tema se llama \"Dentro\" del artista Caito, aparece registrada a nombre de Difusora del Folklore en 1981, pero me parece que esa compañía se volvió Fonarte Latino; es decir, ustedes. Un artista de nuestro label llamado Aloof Oz usa el sample del minuto 1:10 de ese tema, para una producción de género lo-fi. Este es el tema original: https://open.spotify.com/track/5d7I7gUw9cvMQRpUBiHtvp?si=3307e116326743cd \r\nEste es el tema de Aloof Oz: https://aloofoz.bandcamp.com/album/calor-de-verano\r\n\r\nLes agradezco muchísimo su atención y espero podamos llegar a un acuerdo formal. Saludos.', '2021-07-22', '09:34:59'),
