(603, 'Anna Oakes', 'annaoakes@gmail.com', '9175668658', 'Soy una productora en el podcast de Spotify llamado \"Legado\", una exploración sobre la historia y las vidas  afro descendientes en América Latina presentado por la periodista Mábel Lara.  \r\n\r\nEn cada episodio nos enfocamos en la obra y la influencia de un artista afro latino histórico y uno creciente.\r\n\r\nEstamos haciendo un episodio sobre Toña la Negra, en relación con la cantante mexicana Alejandra Robles, y nos encantaría utilizar apartes de unas canciones suyas para discutir y mostrar su arte:\r\n-El Negro de la Costa (álbum La Malagueña, 2005)\r\n-La Llorona (álbum La Morena, 2008)\r\n-La Morena (álbum La Sirena, 2013)\r\n-La Llorona (Carlos Cuevas y Alejandra Robles - Méxicolombia, álbum La Sirena, 2013)\r\n\r\n¿Cuál sería el proceso para liberar un fragmento de esta canción para nuestro episodio? Y, de paso, ¿Cree que sería posible concretar una llamada para discutirlo y explicarle un poco más, por favor? \r\n\r\nMuchas gracias de antemano. Quedo atenta a su respuesta.', '2021-08-13', '12:21:46'),
