(2, '7509841215756', 'CDDP-1575', 'CDDP', 'A Love Electric', 'The Naked Beat', '36', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify:album:4AGzQLUBgZhNniqzDQEEYO', NULL, 'https://www.amazon.com/Naked-Beat-Todd-Clousers-Electric/dp/B00AJLHTNG/ref=sr_1_1_twi_aud_2?ie=UTF8&qid=1480380687&sr=8-1&keywords=The+Naked+Beat++Todd+Clouser', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-1575.jpg', NULL, NULL, 'Un gran disco de 10 temas del gran Todd Clouser y su proyecto A Love Electric. Participan músicos de la talla de Aarón Cruz en el bajo y Hernán Hetch en la batería… combinación comprobada de calidad, buen sonido y alto nivel musical.', '2017-03-09', '11:51:47', 1, 'ACTIVO', 'Si', NULL, NULL),
