(347, '7509841216937', 'CDDP-1693', 'CDDP', 'Gaston', 'Desdibújate (Deluxe Version)', '28', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A6jNAouvh12cMV3Tt8q6avV', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-1693.jpg', NULL, NULL, 'Músico compositor México-Argentino. Inició su carrera como guitarrista de las bandas tapatías In::Nova, Inbox y Rox con gran éxito. Da tutoriales de canto en YouTube con 4 millones de visitas y miles de suscriptores, apoyados por su participación en La Voz México 4ª temporada en e equipo de Laura Pausini. Ésta es su 2a producción de estudio con toques de Pop-Rock Soul, con 10 temas y 3 Bonus Tracks en inglés.', '2017-03-08', '12:58:00', 1, 'ACTIVO', 'Si', NULL, NULL),
