(349, '7509841317467', 'CDFL-1746', 'CDFL', 'Gerardo Peña', 'Reconstrucción', '6', '49', '49', 1, 'Si', 'https://open.spotify.com/album/5kBhy3vAYwI2ajjFXriEzZ?si=-s4acqHmR2iJ5AFTT77wPw&dl_branch=1', 'https://itunes.apple.com/mx/album/reconstrucci%C3%B3n/id1168703673', 'https://www.amazon.com/Reconstrucci%C3%B3n-Gerardo-Pe%C3%B1a/dp/B01MXVQB0U/ref=sr_1_3?s=dmusic&ie=UTF8&qid=1485543031&sr=1-3&keywords=Gerardo+Pe%C3%B1a&refinements=p_n_feature_browse-bin%3A625150011', NULL, 'https://music.amazon.com.mx/albums/B01MXVQB0U?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_mb5pOl89pzAeW_2ayJmdWwPyKjo1TnwB4&feature=share', 'https://deezer.page.link/K91usQtyoM9uKmZQA', 'https://tidal.com/browse/album/66374452', 'img/caratulas/2017_02_21_12_04_23__CDFL-1746.jpg', NULL, NULL, 'Regresa uno de los compositores más grabados en la escena de la trova en\r\nMéxico. El “Meñe” ha sido interpretado por Delgadillo, Mexicanto,\r\nAlejandro Santiago y muchos otros cantautores y está de regreso con un\r\ndisco interpretado por él mismo que contiene 13 tracks nuevos para todos\r\nlos seguidores de la trova mexicana.', '2021-08-04', '10:05:32', 1, 'ACTIVO', 'Si', NULL, NULL),
