(379, '7509841216623', 'CDDP-1662', 'CDDP', 'Inspector', 'Inspección Retroacústica', '43', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify:album:6BPO85IdQxuZ1TtoiM7ysk', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-1662.jpg', NULL, NULL, 'La tan esperada producción de la principal banda de Ska en México.\r\nInspector presenta su Inspección Retroacústica con 11 temas que han\r\nsido sus éxitos como Amnesia, Y Qué, Me Estoy Enamorando en\r\nversiones acústicas conservando la fuerza y potencia de la banda.', '2017-06-23', '12:20:21', 1, 'INACTIVO', 'No', NULL, NULL),
(380, '7509841215510', 'CDDP-1551', 'CDDP', 'Inspector', 'Ska a La Carta', '43', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify:album:2h8m3JO1mo6Kew8UEQDtPd', NULL, 'https://amzn.to/2J7Ib2a', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-1551.jpg', NULL, NULL, 'Grupo más representativo del Ska en nuestro país. INSPECTOR presenta el Ska a la Carta, donde realizan sus propias versiones al estilo del Inspector, de temas de Juan Gabriel, Alex Lora, Consuelo Velázquez, Leo Dan y muchos otros. Contiene 12 tracks que incluyen 2 bonus tracks, uno con el gran CELSO PIÑA y otro en vivo desde el Café Iguana.', '2020-10-30', '14:38:14', 1, 'ACTIVO', 'Si', NULL, NULL),
(381, '7509841217637', 'CDDP-1763', 'CDDP', 'Inspector', 'Inspector', '43', '36', '35', 1, 'Si', 'https://open.spotify.com/album/3q5bV5Fq3XEzbW5a0mAfcB', 'https://itunes.apple.com/mx/album/id319834662', 'https://www.amazon.com/Inspector/dp/B002GURERE/ref=sr_1_3?s=dmusic&ie=UTF8&qid=1485543463&sr=1-3&keywords=Inspector&refinements=p_n_feature_browse-bin%3A625150011', NULL, NULL, 'https://music.youtube.com/playlist?list=OLAK5uy_ldepIe0khLZy1e-KVmeVrUjiVVQ8nJCy0', 'https://www.deezer.com/mx/album/1108863', 'https://tidal.com/album/9054576', 'img/caratulas/CDDR-4048.jpg', NULL, NULL, 'Sonando desde 1995, Inspector regresó en 2009 con su quinta producción llamada \"INSPECTOR\", ahora de manera independiente con Fonarte Latino. Este gran disco contiene covers como: \"Bésame Mucho\" y el clásico de Madness \"Our House\", también en este material se incluye un dueto en el tema \"Noviembre\" con la cantante mexicana Ely Guerra. Sus temas \"Y Qué\" y \"Es Por Ti\" ya son clásicos de la banda más importante de Ska en México.', '2021-08-04', '12:33:57', 1, 'ACTIVO', 'Si', NULL, NULL),
