(400, '7509841216906', 'CDDP-1690', 'CDDP', 'Jaramar & Caída Libre', 'Wait For The Rain', '27', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A0wWdIIzjwQsbBO7TVcyoDc', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-1690.jpg', NULL, NULL, 'Proyecto de la gran intérprete Jaramar junto con Alejandro Alfaro y\r\nEliud Ernandes. Interpretan temas del repertorio clásico del jazz y otros\r\nque Caída Libre ha integrado a su particular sonido. El álbum contiene\r\n14 temas como: Amazing Grace, Moon River, Over the Rainbow, Man I\r\nLove y No Sunshine, entre otros.', '2017-03-08', '12:58:40', 1, 'ACTIVO', 'Si', NULL, NULL),
(401, '7509841316910', 'CDFL-1691', 'CDFL', 'Jaramar y El Cuarteto Latinoamericano', 'El Hilo Invisible (Cantos Sefaradíes)', '42', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A1YlcoRRXRXjazmDihiux0P', NULL, 'https://www.amazon.com/EL-HILO-INVISIBLE-Cantos-Sefarad%C3%ADes/dp/B016P24Q9W/ref=sr_1_1?s=music&ie=UTF8&qid=1480062726&sr=1-1&keywords=Jaramar+y+El+Cuarteto+Latinoamericano', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDFL-1691.jpg', NULL, NULL, 'GRAMMY LATINO 2016 \r\nMEJOR ÁLBUM DE MÚSICA CLÁSICA\r\n\r\nGran álbum para la discografía extensa de la cantante y compositora\r\nJaramar, en un proyecto de cantos sefaradíes. En este proyecto la\r\nacompaña el famoso Cuarteto Latinoamericano. Interpretan cantos\r\nsefaradíes grabados en la Sinagoga Histórica Justo Sierra 71 de la Ciudad\r\nde México. Contiene 10 tracks.', '2017-03-08', '12:58:37', 1, 'ACTIVO', 'Si', NULL, NULL),
