(406, '7509841550178', 'DVDF-5017', 'DVDF', 'Jas Devael', 'El Consentido (CD + DVD)', '6', '28', '49', 1, 'Si', 'https://open.spotify.com/album/2nGjM9uoFguZoabER705TG', 'https://itunes.apple.com/mx/album/id1050720251', 'https://www.amazon.com/El-Consentido-Vivo-Jas-Devael/dp/B018K9GSVW/ref=sr_1_4?s=dmusic&ie=UTF8&qid=1485543777&sr=1-4&keywords=Jas+Devael&refinements=p_n_feature_browse-bin%3A625150011', NULL, 'https://music.amazon.com.mx/albums/B018K9GSVW?ref=dm_sh_5413-37ad-dmcp-b5be-b3ca0&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_kPEY4H1kNsDFtlALU1sM0ZmxrF9IdnMiw', 'https://www.deezer.com/album/11548112?utm_source=deezer&utm_content=album-11548112&utm_term=2582078102_1559071316&utm_medium=web', 'https://tidal.com/album/53004084', 'img/caratulas/DVDF-5017.jpg', NULL, NULL, 'Después del éxito de “El Consentido” (mariachi fusionado con orquesta).\r\nJas presenta una grabación en vivo desde el Lunario del Auditorio\r\nNacional. Interpreta los 10 temas del Consentido así como homenajes a\r\nRaphael y a Juan Gabriel quien le dio 2 temas inéditos para esta\r\ngrabación. El DVD incluye un making of y el concierto completo en\r\ndirecto. El CD contiene 16 temas y un bonus track.', '2022-01-24', '10:10:32', 1, 'ACTIVO', 'Si', NULL, NULL),
