(422, '7509841272865', 'CDDP-7286', 'CDDP', 'José Fors', 'Dr. Frankenstein (2CDs)', '36', '49', '49', 1, 'Si', 'https://open.spotify.com/album/3sKPTunf6ihbCftBxVgAhE?si=8I5Dgb3_RDiU6NC1yO6qzA&dl_branch=1', 'https://itunes.apple.com/mx/album/dr.-frankenstein/id859574203', 'https://www.amazon.com/Dr-Frankenstein-Jos%C3%A9-Fors/dp/B00JVOZ3GM/ref=sr_1_3?s=dmusic&ie=UTF8&qid=1485544365&sr=1-3&keywords=Jos%C3%A9+Fors&refinements=p_n_feature_browse-bin%3A625150011', NULL, 'https://music.amazon.com.mx/albums/B00JVOZ3GM?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_leyi_c6xiVxsZF7JTrL2C7nCAEtHhgD1w&feature=share', NULL, 'https://tidal.com/browse/album/28741907', 'img/caratulas/CDDP-7286.jpg', NULL, NULL, 'La primer ópera rock en México. Creada por el gran cubano José Fors (Cuca, Forseps). Participan grandes exponentes de la música en México como Iraida Noriega.\r\nAquí el álbum doble con la obra completa.', '2021-08-09', '13:23:24', 1, 'DIGITAL', 'Si', NULL, NULL),
(423, '7502238603426', 'CDDP-1598', 'CDDP', 'José Fors', 'Orlok El Vampiro', '36', '49', '49', 1, 'Si', 'https://open.spotify.com/album/0RmqQ7Nltvz0dkTIttjSW7?si=ehQ-rRKET86lvnDpAgYhrw&dl_branch=1', 'https://itunes.apple.com/mx/album/orlok-el-vampiro/id859576151', 'https://www.amazon.com/Orlok-el-Vampiro-Jos%C3%A9-Fors/dp/B06XSVPWKY/ref=sr_1_fkmr1_4?ie=UTF8&qid=1490724589&sr=8-4-fkmr1&keywords=orlok+jose+fors+cd', NULL, 'https://music.amazon.com.mx/albums/B06XSVPWKY?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_lenU7qWMaBtGpoih1Tr-62k9JSlKXRNrA&feature=share', 'https://deezer.page.link/HY5Ff8YaDuypfHy66', 'https://tidal.com/browse/album/71993769', 'img/caratulas/CDDP-1598.jpg', NULL, NULL, 'Segunda ópera rock del gran José Fors. Después del éxito de Dr. Frankenstein, José Fors realiza esta puesta en escena de la historia de Orlok el Vampiro, la historia de Drácula o el Nosferatu.\r\nAquí la obra completa en un álbum de colección.', '2021-08-09', '13:23:25', 1, 'ACTIVO', 'Si', NULL, NULL),
(424, '7509841214520', 'CDDP-1452', 'CDDP', 'José Fors', 'Reproducciones Vol. 1', '36', '35', '49', 1, 'Si', 'https://open.spotify.com/album/1adqpReHSZNnuGRiU6dV9k?si=jryh7fImTyO-QGAsb6YEjQ&dl_branch=1', 'https://itunes.apple.com/mx/album/reproducciones-vol.-1/id859449009', 'https://www.amazon.com/Reproducciones-Vol-1-Jos%C3%A9-Fors/dp/B00JVOZSDU/ref=sr_1_1?s=dmusic&ie=UTF8&qid=1485544365&sr=1-1&keywords=Jos%C3%A9+Fors&refinements=p_n_feature_browse-bin%3A625150011', NULL, 'https://music.amazon.com.mx/albums/B00JVOZSDU?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_mrTUKCVT72hNXom9w7Fl8kwnIdpFKJw5E&feature=share', NULL, 'https://tidal.com/browse/album/28741863', 'img/caratulas/CDDP-1452.jpg', NULL, NULL, 'José Fors, nacido en La Habana, Cuba, nacionalizado mexicano y conocido por su trabajo en Forseps, La Cuca, su ópera Rock Dr. Frankenstein e innumerables proyectos musicales y pintura en exposiciones, Fors ha decidido volver a grabar los temas de mayor éxito y popularidad entre sus fans en un disco con nuevas versiones actuales. El disco incluye 1 tema inédito y 15 temas clásicos previamente grabados.\r\n', '2021-08-09', '13:23:26', 1, 'DIGITAL', 'Si', NULL, NULL),
