(428, '7509841217101', 'CDDP-1710', 'CDDP', 'Juan Carlos Portillo', 'Fuego Nuevo', '13', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A662bonIixZSmsAkNth2lkr', NULL, 'https://www.amazon.com/gp/offer-listing/B01AFFAW0C/ref=tmm_acd_new_olp_0?ie=UTF8&condition=new&qid=1485544435&sr=1-4-mp3-albums-bar-strip-0', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_21_12_12_09__CDDP-1710.jpg', NULL, NULL, 'Fusión de elementos del rock progresivo y de la música hecha con\r\ninstrumentos prehispánicos. El músico y productor Juan Carlos Portillo\r\npresenta su segunda producción Fuego Nuevo, en la que muestra su\r\ntalento para mezclar estos dos universos sonoros con un sello muy\r\npersonal.', '2021-01-27', '13:25:02', 1, 'INACTIVO', 'Si', NULL, NULL),
(429, '7509848013010', 'CDDP-1684', 'CDDP', 'Juan Carlos Portillo', 'Duality', '13', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A2NPxrrWHq3jlMxtmkiT1d2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-1684.jpg', NULL, NULL, 'Disco de la serie ETNO que editan Terraza Records e Histeria Colectiva con el proyecto de Juan Carlos Portillo que mezcla el rock progresivo y la música hecha con instrumentos prehispánicos. Contiene 14 temas inéditos.', '2019-01-10', '12:00:18', 1, 'INACTIVO', 'No', NULL, NULL),
