(431, '7509841315685', 'CDFL-1568', 'CDFL', 'Juan Perro & José Fors', 'Sesiones con Si Son', '36', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify:album:3vEPcxW4Ut0nIdqqgFE8ht', NULL, 'https://www.amazon.com/gp/offer-listing/B00DGXRSEO/ref=tmm_other_meta_binding_new_olp_sr?ie=UTF8&condition=new&qid=1480394295&sr=8-1', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDFL-1568.jpg', NULL, NULL, 'Santiago Auserón Marruedo, también conocido como Juan Perro, es un cantante y compositor español de Zaragoza. Fue compositor y vocalista del grupo musical Radio Futura. José Fors, ya conocido por su trayectoria con La Cuca, Forceps, Dr. Frankenstein y mucho más. Dos grandes personalidades se juntan en un disco de Sesiones al estilo de Son con sabor a rumba.', '2019-01-10', '12:43:36', 1, 'ACTIVO', 'Si', NULL, NULL),
