(589, '7509841217088', 'CDDP-1708', 'CDDP', 'Luis Perez', 'Suspended Spheres', '13', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A7AxkKQ6KoKCT6JJCHh84F7', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_24_11_24_00__CDDP-1708.jpg', NULL, NULL, 'El legendario maestro y considerado el creador del etno rock, la etno\r\nelectrónica y la etno experimental, presenta un nuevo disco, con un\r\nnivel artístico a la altura de su jerarquía. Una edición trigipack de lujo,\r\nenmarca una obra que plantea un viaje fantástico por los terrenos de la\r\netno experimentación.', '2017-03-08', '12:53:29', 1, 'ACTIVO', 'Si', NULL, NULL),
