(648, '7509841317405', 'CDFL-1740', 'CDFL', 'Mexicolombia Fusion Project', 'Pacificonexión', '15', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A1UkgR9DVbDrnLEwair5caN', 'https://itunes.apple.com/mx/album/id1145548724', 'https://www.amazon.com/Pacificonexi%C3%B3n-Mexicolombia-Fusion-Project/dp/B01KSZC6HG/ref=sr_1_1?s=dmusic&ie=UTF8&qid=1485549038&sr=1-1-mp3-albums-bar-strip-0&keywords=Pacificonexi%C3%B3n', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDFL-1740.jpg', NULL, NULL, 'Conformado en 2011 por 8 músicos de México y Colombia que propone\r\nritmos y sonidos que van desde la cumbia afrocolombiana, el bullerengue,\r\nel porro y el bunde, al son jarocho, son istmeño, chilenas y la canción y\r\ncorridos mexicanos logrando una fusión muy interesante. El álbum contiene\r\n10 tracks.', '2017-03-08', '12:40:42', 1, 'ACTIVO', 'Si', NULL, NULL),
(649, '7509841274029', 'CDDP-7402', 'CDDP', 'Mexkla', 'La Mexkla (En Vivo)', '1', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A1HOx8sSNf7lXDoTY4Sn3SR', 'https://itunes.apple.com/mx/album/la-mexkla-en-vivo/id1101388636', 'https://www.amazon.com/Mexkla-en-Vivo/dp/B01E0N0YK8/ref=sr_1_1?s=dmusic&ie=UTF8&qid=1485549055&sr=1-1-mp3-albums-bar-strip-0&keywords=Mexkla', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-7402.jpg', '', NULL, '', '2018-11-03', '12:20:20', 1, 'DIGITAL', 'Si', NULL, NULL),
(650, '7509841316736', 'CDFL-1673', 'CDFL', 'Michael Nyman', 'Retrospectiva', '44', '49', '49', 1, 'Si', NULL, NULL, 'https://www.amazon.com/RETROSPECTIVA-MICHAEL-NYMAN/dp/B00Y7FH1OW/ref=sr_1_1?ie=UTF8&qid=1485549256&sr=8-1&keywords=michael+nyman+fonarte+latino', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_24_11_34_20__CDFL-1673.jpg', 'img/caratulas/2017_03_09_13_07_00__nyman.jpg', NULL, 'Gran trabajo recopilatorio de uno de los compositores de música para cine más conocidos en el medio Michael Nyman (El Piano). Independent recordings hace esta compilación de su trabajo y la pone disponible en 13 tracks.', '2017-03-09', '13:06:34', 1, 'ACTIVO', 'Si', NULL, NULL),
(651, '7509841273077', 'CDDP-7307', 'CDDP', 'Miguel Inzunza', 'Circo Bicicleta', '6', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A5nR6l8jULKPwCmdlmhJeVF', 'https://itunes.apple.com/mx/album/circo-bicicleta/id881548021', 'https://www.amazon.com/Circo-Bicicleta-Miguel-Inzunza/dp/B00KNDMWIM/ref=sr_1_5?s=dmusic&ie=UTF8&qid=1485549284&sr=1-5-mp3-albums-bar-strip-0&keywords=Miguel+Inzunza', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-7307.jpg', NULL, NULL, 'Uno de los más reconocidos cantautores en la escena con mayor calidad musical y comprometido con la letra. En 2009 presenta el disco CIRCO BICICLETA que cuenta con la participación de músicos de nivel internacional, como los hermanos Barrera, integrantes del grupo de jazz B4, y una canción en coautoría con el compositor brasileño Leo Minax.', '2017-04-25', '12:02:59', 1, 'DIGITAL', 'Si', NULL, NULL),
(652, '7509841273060', 'CDDP-7306', 'CDDP', 'Miguel Inzunza', 'Fábrica de Aves', '6', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A1FQU8I3CDtjJkAi8Xi7bRu', 'https://itunes.apple.com/mx/album/fabrica-de-aves/id881545740', 'https://www.amazon.com/F%C3%A1brica-Aves-Miguel-Inzunza/dp/B00KNDZY8C', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-7306.jpg', NULL, NULL, 'Compositor, cantante, guitarrista y productor de la escena de la música independiente en México. Fusiona géneros y ritmos diversos que dan como resultado un sonido alternativo, fresco y emotivo, en el que la canción es hilo conductor y a la vez protagonista.\r\nComprometido con las letras, va desde lo más desenfadado a lo más intimista, imprimiendo siempre frescura y actualidad como características principales.\r\n \r\nUsa la tecnología al servicio de la canción, y en su búsqueda incorpora timbres electrónicos, loops e instrumentos acústicos que dan como resultado una propuesta de personalidad modernista y al mismo tiempo emotiva. En 2013 lanza \"Fábrica de Aves\" producción independiente en la que conjuga lo más actual de su sonido y una selección de 14 canciones de su autoría que fueron filtradas por la selección natural de los últimos años. cuenta con la participación de LOS CLAXONS una de las bandas rock pop más importantes de México grabando a dueto.', '2017-04-25', '12:00:29', 1, 'DIGITAL', 'Si', NULL, NULL),
(653, '7509841273084', 'CDDP-7308', 'CDDP', 'Miguel Inzunza', 'Que Nadie Se Entere', '6', '49', '49', 1, 'Si', 'https://open.spotify.com/album/6hVFxpqlDUBu4ZXMBBV5nZ', 'https://itunes.apple.com/mx/album/que-nadie-se-entere/id881548359', 'https://www.amazon.com/Arr%C3%ADtmico/dp/B00KOZL3KM', NULL, 'https://music.amazon.com.mx/albums/B00KOZL2L2?ref=dm_sh_3ef4-ee84-dmcp-2e62-05efe&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_kqqYz6BbUZEIJJYfwh85dVFhSsKOb-jrY', 'https://www.deezer.com/album/7855869?utm_source=deezer&utm_content=album-7855869&utm_term=2582078102_1556657337&utm_medium=web', 'https://tidal.com/album/30256012', 'img/caratulas/CDDP-7308.jpg', NULL, NULL, 'Segunda producción en el mercado independiente lanzada en 2003. Titulada: \"Que Nadie Se Entere\" grabada y producida por el mismo Miguel Inzunza en formato de guitarra acústica y loops.', '2020-01-17', '12:53:25', 1, 'DIGITAL', 'Si', NULL, NULL),
