(713, '7509841213974', 'CDDP-1397', 'CDDP', 'Pedro Aznar', 'Quebrado', '36', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify:album:6XKz1bJUC9xfPu2xnA3NcJ', 'https://itunes.apple.com/mx/album/quebrado/292661580', 'http://a.co/hkkgmRW', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/CDDP-1397.jpg', NULL, NULL, 'Pedro Aznar es un cantante, multi-instrumentista y compositor argentino. Fue integrante de los grupos Madre Atómica, Alas, Serú Girán y Pat Metheny Group, y desde 1993 está dedicado por completo a su carrera como solista.\r\n\r\nHa editado más de 30 álbumes entre discos de estudio, grabaciones en vivo, bandas sonoras de películas y dúos con músicos como Charly García y David Lebón. También ha colaborado con las bandas progresivas Pastoral, Billy Bond and the Jets y Spinetta Jade.\r\n\r\nAdemás de 180 composiciones propias publicadas, en su carrera solista ha dedicado especial cuidado a grabar alrededor de 120 covers y arreglos de temas de músicos latinoamericanos, norteamericanos y británicos tales como Luis Alberto Spinetta, Gustavo Cerati, Charly García, Atahualpa Yupanqui, Victor Jara, Violeta Parra, Congreso, Chabuca Granda, Chico César, Lenine, Cazuza, Chico Buarque, Tom Jobim, Milton Nascimento, Caetano Veloso, Gilberto Gil, Ivan Lins, Egberto Gismonti, Elton John, Jeff Buckley, The Beatles, Sting y Rolling Stones, entre muchos otros.\r\n\r\nQuebrado fue un álbum que se logró editar por primera vez en México en 2008, trayendo el trabajo de uno de los más importantes exponentes del rock argentino a nuestro país.', '2018-08-17', '09:45:55', 1, 'ACTIVO', 'Si', NULL, NULL),
