(979, '7509841217095', 'CDDP-1709', 'CDDP', 'Zompantli', 'Raíces', '13', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A3LbpxwXuz74LUmxrUm5hCe', NULL, 'https://www.amazon.com/gp/offer-listing/B01AFFAV6M/ref=tmm_acd_new_olp_0?ie=UTF8&condition=new&qid=1485561109&sr=1-1-mp3-albums-bar-strip-0', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_24_12_42_09__CDDP-1709.jpg', NULL, NULL, 'Zompantli ex Wicholly Broders presenta una propuesta de fusión de la\r\nmúsica electrónica y la música hecha con instrumentos prehispánicos.\r\nActualmente son uno de los grupos más activos de la escena alternativa\r\npoblana. En 2013 editaron su álbum debut en un tiraje de mil unidades,\r\nel cual se agotó. Ahora, en 2015, lo remasterizaron y lo están\r\nrelanzando con el grupo en pleno ascenso.', '2017-03-08', '12:53:34', 1, 'ACTIVO', 'Si', NULL, NULL),
