(981, '7509841217538', 'CDDP-1753', 'CDDP', 'Mystica Girls', 'Verónica, La Cortesana del Infierno', '17', '35', '1', 1, 'Si', 'https://open.spotify.com/embed/album/5XB3nbbGIQsIU9X8KgnKmg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_27_09_11_43__CDDP-1753.jpg', NULL, NULL, 'Tercera producción en la carrera de esta gran banda integrada por mujeres.\r\nSiempre han demostrado que el concepto del Heavy Metal mexicano puede\r\nser interpretado por mujeres con un gran nivel. Esta producción cuenta con\r\n12 temas inéditos.', '2017-08-07', '09:27:08', 1, 'ACTIVO', 'Si', NULL, NULL),
(982, '7509841317566', 'CDFL-1756', 'CDFL', 'Carlos Macías', 'Mi Música', '6', '28', '49', 1, 'Si', 'https://open.spotify.com/album/1A9BpDgclE8OQLADxYxhS1', 'https://itunes.apple.com/mx/album/mi-m%C3%BAsica/id1173640979', 'https://www.amazon.com/Mi-M%C3%BAsica-Carlos-Mac%C3%ADas/dp/B01MSJ9QGD/ref=sr_1_1?ie=UTF8&qid=1488218205&sr=8-1&keywords=carlos+macias+mi+musica', NULL, 'https://music.amazon.com.mx/albums/B01MSJ9QGD?ref=dm_sh_693c-e6a6-dmcp-4291-dd546&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_nOAkhKJBBGJ_GOku-HyFHGq4u5o7yH8GQ', 'https://www.deezer.com/mx/album/14507238', 'https://tidal.com/album/66962221', 'img/caratulas/2017_02_27_09_15_33__CDFL-1756.jpg', NULL, NULL, 'Más reciente producción de uno de los compositores más reconocidos de\r\nMéxico. Carlos Macías presenta “Mi Música”, álbum de gran madurez de\r\ncomposición e interpretación que incluye 13 temas de su autoría con singles\r\ncomo “Besos Rotos” y “Ella Es”. El disco se encuentra ya en los primeros\r\nlugares de las plataformas digitales.', '2020-01-20', '09:32:22', 1, 'ACTIVO', 'Si', NULL, NULL),
(983, '7509841317542', 'CDFL-1754', 'CDFL', 'Alberto Escobar', 'Antología Breve (2CDs)', '6', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A2a6ZCt1C4M1RttVLeeG3w2', 'https://itunes.apple.com/mx/album/antologi-a-breve/id1177110068', 'https://www.amazon.com/Antolog%C3%ADa-Breve-Alberto-Escobar/dp/B01N64GDE5/ref=sr_1_2?ie=UTF8&qid=1488221116&sr=8-2&keywords=alberto+escobar+antologia', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_27_10_48_00__CDFL-1754.jpg', NULL, NULL, '.El reconocido compositor del tema “COINCIDIR” presenta esta recopilación\r\nde su trabajo de muchos años de trayectoria como cantautor y compositor.\r\nAlberto Escobar edita su antología de 32 temas en 2 CD´s para todos los\r\namantes de la trova y la canción de autor.', '2017-03-08', '12:41:33', 1, 'ACTIVO', 'Si', NULL, NULL),
(984, '7509841317528', 'CDFL-1752', 'CDFL', 'Rodrigo Rojas', 'Arena', '6', '49', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A4Qb3BqAHrybaO7GAg23DkW', 'https://itunes.apple.com/mx/album/arena/id1164186140', 'https://play.google.com/store/music/album/Rodrigo_Rojas_Arena?id=Bgunqmbbth4qo52q6sq3f2qu3im', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_27_11_00_05__CDFL-1752.jpg', NULL, NULL, 'El cantautor boliviano Rodrigo Rojas está de vuelta con una gran producción\r\nde 11 temas. Incluye temas con invitados especiales como Edgar Oceransky\r\ny Adrián Gil. Siempre romántico en sus letras, Rodrigo ha logrado\r\nposicionarse como uno de los cantautores más seguidos en México.', '2017-02-27', '10:56:57', 1, 'ACTIVO', 'Si', NULL, NULL),
(985, '7509841317399', 'CDFL-1739', 'CDFL', 'Alejandro Escuer', 'Luz Negra', '9', '7', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A4wlwIFCB3L0jQR6iAsIHVM', 'https://itunes.apple.com/mx/album/luz-negra/id1186038597', 'https://www.amazon.com/gp/product/B01MSYWNKG/ref=dm_ws_sp_ps_dp', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_27_11_04_10__CDFL-1739.jpg', NULL, NULL, 'El virtuoso flautista, artista sonoro, artista plástico y académico mexicano\r\ndestacado por sus múltiples proyectos de alto impacto y originalidad\r\npresenta esta producción de 13 temas de grandes compositores como\r\nEduardo Gamboa, Alejandro Colavita y el mismo Escuer.', '2017-02-27', '11:13:45', 1, 'ACTIVO', 'Si', NULL, NULL),
(986, '7509841317627', 'CDFL-1762', 'CDFL', 'Juan Carlos Portillo & Mezme', 'Omeyocan - Caminos y Senderos', '13', '48', '49', 1, 'Si', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_27_11_09_20__CDFL-1762.jpg', NULL, NULL, 'Un disco que presenta un encuentro de talentos que da como resultado una\r\nobra estupenda en la que fusiona el sonido de los instrumentos\r\nprehispánicos y el rock progresivo. El álbum contiene 11 temas incluyendo\r\nun remix como bonus Track.', '2017-02-27', '11:06:37', 1, 'ACTIVO', 'Si', NULL, NULL),
(987, '7509841550185', 'DVDF-5018', 'DVDF', 'Lucy Blues', 'Somos Hijos del Diablo (2 CDs)', '3', '35', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aalbum%3A6ACvO78D6DOfL5fWm3H5dt', 'https://itunes.apple.com/mx/album/somos-hijos-del-diablo/id1206535769', 'https://www.amazon.com/Somos-Hijos-Diablo-Lucy-Blues/dp/B06W9L836Q/ref=sr_1_1?ie=UTF8&qid=1488222753&sr=8-1&keywords=lucy+blues+somos+hijos', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_02_27_11_13_09__DVDF-5018.jpg', NULL, NULL, 'Proyecto nuevo del vocalista, fundador y compositor de la legendaria\r\nagrupación REAL DE CATORCE. José Cruz presenta este nuevo proyecto\r\nacompañado de grandes músicos en un álbum doble y un arte muy\r\nnovedoso. Se compone de dos CD´s titulados EROS y TANATOS.', '2017-02-27', '11:09:21', 1, 'ACTIVO', 'Si', NULL, NULL),
(988, '7509841000031', 'LP6-01', 'LP6', 'Various Artists', 'Antología de la Música Electrónica y del Arte del Ruido (4 Vinilos)', '9', '12', '49', 3, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_04_11_13_14_33__musica electrÃ³nica.jpg', 'img/caratulas/2017_04_11_13_17_40__musica electrÃ³nica sheet.jpg', NULL, 'Independent Recordings en colaboración con Sub Rosa se enorgullece en lanzar al mercado mexicano\r\nla Antología de la Música Electrónica y del Arte del Ruido en vinil cuádruple en edición limitada.\r\nEste volumen comienza en los años veinte con los hermanos Russolo y examina cada década en turno.\r\nVarèse, Cage, Schaeffer, Xenakis? los grandes pioneros, los primeros rastros de una música que fue\r\nnecesariamente música electrónica, revolucionaria, creada ex nihilo, de la nada y por consecuencia\r\ntotalmente inventada.\r\nAlgunas piezas en estos discos son ciertamente clásicas, pero hay otras que, aunque viejas, se\r\ndistribuyeron poco o informalmente. Las piezas más contemporáneas que contiene son, aunque editadas\r\npreviamente, referencia obligada, dignas de ser objeto de escucha continua e incluye a Tuxedomoon,\r\nThrobbing Gristle, Sonic Youth, Brian Eno, Einstürzende Neubauten, Fennesz y Murcof, entre otros. De\r\neste modo hacemos un recorrido por casi un siglo de música electrónica innovadora, de 1921 a 2009.', '2017-04-12', '10:54:31', 1, 'ACTIVO', NULL, NULL, NULL),
