(1002, '7509841216654', 'CDDP-1665', 'CDDP', 'Cardencheros de Sapioriz', 'Un Amor Pendiente', '14', '48', '49', 1, 'Si', 'https://embed.spotify.com/?uri=spotify%3Aartist%3A6Lpc8bc1fqwkNQTodU95tg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_03_08_13_13_42__CDDP-1665.jpg', NULL, NULL, 'Gran trabajo de rescate de la música Cardenche de la región de la laguna (Norte de México, Durango-Coahuila). Realizado por Todd Clouser (A Love Electric) y con invitados especiales como Alex Mercado, Aarón Cruz, Iraida Noriega, Juan Manuel Torreblanca, Leo Soqui, Juan Pablo Villa, entre otros. Contiene 16 tracks.', '2021-01-27', '13:24:21', 1, 'INACTIVO', 'Si', NULL, NULL),
