(1005, '7509841010023', 'LP1-02', 'LP1', 'Elfmilk', 'Relocation (Vinil)', '1', '49', '49', 3, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_04_12_11_02_08__elfmilk1.jpg', 'img/caratulas/2017_04_12_11_02_08__elfmilk1 sheet.jpg', NULL, 'Relocation es el nuevo proyecto en colaboración del saxofonista Xavier Baviera, ex miembro del grupo\r\nseminal de art-rock Decibel y Eduardo Harari, con una instrumentación dotada por sus actuales\r\nintegrantes, -músicos que han tocado, grabado y experimentado en diferentes proyectos\r\nde electrónica, rock, jazz, free jazz, avant garde y experimental.\r\nEl primer álbum homónimo, enfocado a la música electrónica completamente, fue bien\r\nreseñado por la revista The Wire en abril de 2010.', '2017-04-12', '10:52:16', 1, 'ACTIVO', NULL, NULL, NULL),
(1006, '7509841910354', 'LP1-03', 'LP1', 'Elfmilk', 'Extragalactic Distance (Vinil)', '1', '49', '49', 3, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_04_12_11_06_00__elfmilk2.jpg', 'img/caratulas/2017_04_12_11_06_00__elfmilk2 sheet.jpg', NULL, 'Elfmilk es responsable de los envolventes sonidos que se encuentran en Extragalactic Distance, una\r\ncolección de ambient abstracto, drones profundos y minimalismo rítmico experimental. Es un proyecto de\r\nmúsica electrónica enfocada en la exploración sonora. Capas de sonidos análogos y digitales construyen\r\npaisajes abiertos a la interpretación. El grupo tiene su origen hace 15 años con la idea de Eduardo Harari\r\nquien hizo uso de todo tipo de instrumentos de fabricación casera, así como grabaciones de sonido de la naturaleza, las ciudades y los ruidos cotidianos, entre otros.', '2017-04-12', '11:07:10', 1, 'ACTIVO', NULL, NULL, NULL),
(1007, '00001', 'LP2-01', 'LP2', 'Clorofila', 'Ahorita Vengo (Vinil)', '36', '49', '49', 3, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_04_12_11_11_51__clorofila.jpg', 'img/caratulas/2017_04_12_11_11_51__clorofila sheet.jpg', NULL, 'Derivado de Nortec Collective, Clorofila, encabezado por Jorge Verdin presenta la edición en vinil de su producción \"Ahorita Vengo\".\r\nCredits:\r\nProgramming, some recording and mixed in Pasadena, CA. Horns and vocals recorded in Tijuana, México by Pedro Meza and Luis Elorza. Art Direction & Design by Jorge Verdin. Photo by Gonzalo González. Mastered @ Precise Mastering by Sam John. Co-Executive producer: Ricardo Guzmán - Ducado Records.\r\n', '2022-03-08', '09:11:48', 1, 'INACTIVO', NULL, NULL, NULL),
(1008, '711623741712', 'LP3-01', 'LP3', 'Los Músicos de José', 'Dilo! Homenaje a Perez Prado (Vinil)', '25', '49', '49', 3, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_04_12_11_16_25__mdj dilo.jpg', 'img/caratulas/2017_04_12_11_16_25__MDJ dilo sheet.jpg', NULL, 'Una de las bandas más representativas del Funk en México presenta un homenaje al Rey del Mambo \"Perez Prado\".\r\n\r\nCredits:\r\nProduced by Aldo Max, David López and José Rojas.\r\nMixing: Aldo Max. Mastering: Harris Newman. Art: Mauricio Limón. Design: Nicolas Chirokoff. Ducado Records design direction: Carmen Irene Gutiérrez', '2021-09-21', '09:46:27', 1, 'ACTIVO', 'No', NULL, NULL),
(1009, '7509841317641', 'CDFL-1764', 'CDFL', 'Cuca', 'Semen', '36', '49', '49', 1, 'Si', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2017_04_17_09_42_13__7509841317641.jpg', 'img/caratulas/2017_04_17_09_42_13__cuca profile.jpg', NULL, 'Cuca es: José Fors (voz), Alejandro Otaola (guitarra), Carlos Avilez (bajo) y Nacho El Implacable González (batería). Grabado en SoundTube por Andrés y Juan Pablo Huerta. Mezclado por Jorge Chiquis Amaro y Masterizado en Oigo Estudios por Arturo Perales. Invitados: María Barracuda, Sergio Arau, Teri Gender, Olivia Luna y La Chiquis Amaro.', '2017-04-17', '09:36:29', 1, 'ACTIVO', 'Si', NULL, NULL),
