(1088, '7509841217897', 'CDDP-1789', 'CDDP', 'La Barranca', 'Lo Eterno', '36', '33', '35', 1, 'Si', 'https://open.spotify.com/album/4TDgqEee92BDBZFBPsL583', 'https://itunes.apple.com/mx/album/lo-eterno/1348841170', 'http://a.co/ivUw4ky', NULL, 'https://music.amazon.com.mx/albums/B07CPYJYC9?ref=dm_sh_38c9-33fe-dmcp-8ea9-eab79&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_lAgpWUuL12bN8g5exPjfchOq8km6iLibM', 'https://www.deezer.com/mx/album/62402912', 'https://listen.tidal.com/album/88090679', 'img/caratulas/2018_02_16_10_51_41__7509841275057.jpg', NULL, 'https://youtu.be/ZoZCEjZ8Mp8', '\"Lo Eterno\", es el undécimo trabajo discográfico de La Barranca. José Manuel Aguilera en la voz y la guitarra, quien además es el compositor de todos los temas, Adolfo Romero en la guitarra, Ernick Romero en el bajo, Yann Zaragoza en el piano y sintetizadores, más Navi Naas en la batería, nos hacen imaginar con el futuro de Lo Eterno. Después de cinco años sin un disco inédito de La Barranca, en este 2018 tenemos su regreso con Lo Eterno. \r\nLes dejamos una muestra aquí: https://www.youtube.com/watch?v=ZoZCEjZ8Mp8\r\n', '2020-01-20', '09:46:28', 1, 'ACTIVO', 'Si', NULL, NULL),
