(1091, '7509841275064', 'CDDP-7506', 'CDDP', 'República del Funk', 'Anatomía de La Vida', '18', '52', '49', 1, 'Si', 'https://open.spotify.com/embed/album/2vcCRZI1kET50FrVhbqTR7', 'https://itunes.apple.com/mx/album/anatom%C3%ADa-de-la-vida/1350542514', 'https://www.amazon.com/Anatom%C3%ADa-Vida-Explicit-Rep%C3%BAblica-Funk/dp/B079XY6GBQ/ref=sr_1_3?s=dmusic&ie=UTF8&qid=1519419244&sr=1-3-mp3-albums-bar-strip-0&keywords=rep%C3%BAblica+del+funk', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2018_02_22_12_01_57__7509841275064.jpg', NULL, NULL, 'República del Funk es una banda de Hip Hop latino que mezcla constantemente en su música la Old School con samplers que conectan su sonido con el jazz, el soul y, por supuesto, el funk.  República del Funk es, sobre todo, un país en el que cualquiera puede ser ciudadano con la única condición de disfrutar del único pasaporte posible: la música. Aquí su álbum ANATOMIA DE LA VIDA', '2018-05-09', '12:53:37', 1, 'ACTIVO', 'Si', NULL, NULL),
