(1093, '7509841275088', 'CDDP-7508', 'CDDP', 'República del Funk', 'Los Profetas del Funk EP', '18', '52', '49', 1, 'Si', 'https://open.spotify.com/album/0XNnW2uBikAk3e02ihYVK1', 'https://itunes.apple.com/mx/album/los-profetas-del-funk-ep/1350548260', 'https://www.amazon.com/Los-Profetas-del-Funk-Explicit/dp/B079Y15Z6G/ref=sr_1_1?s=dmusic&ie=UTF8&qid=1519419244&sr=1-1-mp3-albums-bar-strip-0&keywords=rep%C3%BAblica+del+funk', NULL, 'https://music.amazon.com.mx/albums/B079Y15Z6G?tab=CATALOG&ref=dm_wcp_albm_link_pr_s', 'https://music.youtube.com/playlist?list=OLAK5uy_kYbUF96TqUpYL9SP_0qlPdolCnTpRNGWk', NULL, NULL, 'img/caratulas/2018_02_22_12_03_36__7509841275088.jpg', NULL, NULL, 'República del Funk es una banda de Hip Hop latino que mezcla constantemente en su música la Old School con samplers que conectan su sonido con el jazz, el soul y, por supuesto, el funk.  República del Funk es, sobre todo, un país en el que cualquiera puede ser ciudadano con la única condición de disfrutar del único pasaporte posible: la música. Aquí su EP LOS PROFETAS DEL FUNK', '2020-03-02', '12:31:05', 1, 'ACTIVO', 'Si', NULL, NULL),
(1094, '7509841275095', 'CDDP-7509', 'CDDP', 'Segundo Acto', 'Simplemente Sencillamente', '18', '52', '49', 1, 'Si', 'https://open.spotify.com/embed/album/1bFAXW8H9zGy6sscamCrFY', 'https://itunes.apple.com/mx/album/simplemente-sencillamente/1350549801', 'https://www.amazon.com/Simplemente-Sencillamente-Explicit-Segundo-Acto/dp/B079Y1BGLS/ref=sr_1_1?s=dmusic&ie=UTF8&qid=1519419361&sr=1-1-mp3-albums-bar-strip-0&keywords=segundo+acto+simplemente', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2018_02_22_12_04_46__7509841275095.jpg', NULL, NULL, 'Segundo acto nace como un proyecto paralelo del vocalista Emel One de República del Funk junto al MC Casper Dylan para explorar su creatividad como productor y buscando nuevos sonidos.\r\nSimplemente sencillamente, el título de su primera producción, resume perfectamente su sonido que une al Hip Hop un tono nostálgico y urbano que impregna también las letras.\r\nDestaca, además, la participación de Jimmy Jazz como responsable de la mezcla final y detalles finos de la producción, logrando un beat contagioso y radicalmente moderno.', '2018-05-09', '12:54:43', 1, 'ACTIVO', 'Si', NULL, NULL),
(1095, '7509841275132', 'CDDP-7513', 'CDDP', 'Alfonso Alquicira', 'Lo Que Nunca Imaginé', '6', '28', '49', 1, 'Si', 'https://open.spotify.com/album/3Rg8Locbw96qqiBitCrEjB', 'https://itunes.apple.com/mx/album/lo-que-nunca-imagin%C3%A9/1352474943', 'https://www.amazon.com/Que-Nunca-Imagin%C3%A9-Alfonso-Alquicira/dp/B07B1TVS8H/ref=sr_1_9?ie=UTF8&qid=1520441068&sr=8-9&keywords=alfonso+alquicira', NULL, 'https://music.amazon.com.mx/albums/B07B1TVS8H?ref=dm_sh_c3eb-b477-dmcp-d4c6-26a70&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_narOYQScarzwaT4ruyD8uQWPtxHaSSsQY', 'https://www.deezer.com/album/57757612?utm_source=deezer&utm_content=album-57757612&utm_term=2582078102_1570651791&utm_medium=web', 'https://tidal.com/browse/album/85105532', 'img/caratulas/2018_03_07_08_45_01__7509841275132.jpg', NULL, NULL, 'Producción del cantautor Alfonso Alquicira. 11 temas de su autoría e incluye un dueto con Carlos Macías.', '2020-01-20', '10:12:20', 1, 'DIGITAL', 'Si', 'No', NULL),
(1096, '7509841275149', 'CDDP-7514', 'CDDP', 'Zoé Chamberlain', 'No Hablemos de Amor - Single', '28', '6', '22', 1, 'Si', 'https://open.spotify.com/embed/track/6Yg6AauKivP42yoJbzRDOK', 'https://itunes.apple.com/mx/album/no-hablemos-de-amor-single/1354567817', 'http://a.co/8SPqDkg', NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2018_03_07_10_01_08__7509841275149.jpg', NULL, NULL, 'Zoé Chamberlain es una compositora e intérprete nacida el 20 de diciembre de 1989, originaria de la Ciudad de México. Les presentamos el primer sencillo de su segunda producción impulsada por Televisa Music Publishing. \r\nParalelamente a lo musical, Zoé extiende una propuesta social hacia el público, mostrándose a favor de la adopción y esterilización de mascotas, además de su postura en contra del maltrato animal', '2018-03-07', '10:08:57', 1, 'DIGITAL', 'Si', NULL, NULL),
(1097, '7509841275156', 'CDDP-7515', 'CDDP', 'Big Band Jazz de México', 'Con Sabor a México', '24', '49', '49', 1, 'Si', 'https://open.spotify.com/album/5z4hL561LGU1WGXyURy6V6', 'https://itunes.apple.com/mx/album/con-sabor-a-m%C3%A9xico/1357299973', 'https://www.amazon.com/All-of-Me/dp/B07BCP41GP/ref=sr_1_4?keywords=big+band+jazz+de+mexico&qid=1553546775&s=dmusic&sr=1-4', NULL, 'https://music.amazon.com.mx/albums/B07BCPJ199?ref=dm_sh_ceff-72f3-dmcp-da79-5099d&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_m_nHQr7NOO04GWGEzF5gS-oW-V2XCTOys', 'https://www.deezer.com/album/58728672?utm_source=deezer&utm_content=album-58728672&utm_term=2582078102_1553546932&utm_medium=web', 'https://listen.tidal.com/album/85777069', 'img/caratulas/2018_03_09_09_44_18__7509841275156.jpg', NULL, NULL, 'Quinta producción de estudio de la orquesta Big Band Jazz de México con 20 años de trayectoria. El álbum hace una recopilación de grandes estándares de jazz y clásicos de música mexicana. Además participan músicos como Irving Lara, Enrique Nery y Fela Dominguez ', '2020-01-20', '10:12:21', 1, 'DIGITAL', 'Si', NULL, NULL),
(1098, '7509841275163', 'CDDP-7516', 'CDDP', 'Big Band Jazz de México', 'Big Band Jazz de México and Friends', '24', '49', '49', 1, 'Si', 'https://open.spotify.com/album/4aCn09uVTriISE8mJ07bGk', 'https://itunes.apple.com/mx/album/big-band-jazz-de-m%C3%A9xico-and-friends/1357300237', 'http://a.co/dIdoH1v', NULL, NULL, 'https://music.youtube.com/playlist?list=OLAK5uy_kySliAqFBMnZyAScCZIAUBm9jmElMYj78', 'https://www.deezer.com/mx/album/58671162', NULL, 'img/caratulas/2018_03_09_09_45_58__7509841275163.jpg', NULL, NULL, 'Producción estrenada en Agosto de 2017 de la orquesta Big Band Jazz de México con invitados que los han acompañado en su trayectoria musical como Susana Zabaleta, David Cabazos, Kika Edgar, Yoshio y muchos más.', '2019-11-19', '11:46:33', 1, 'DIGITAL', 'Si', NULL, NULL),
