(1137, '7509841275545', 'CDDP-7554', 'CDDP', 'Human Drama', 'Cause and Effect', '1', '36', '37', 1, 'Si', 'https://open.spotify.com/album/4NR6wsPBSXK8dsrxWzFEgg', 'https://itunes.apple.com/mx/album/cause-and-effect/1424509175', 'http://a.co/5rGJd0w', NULL, 'https://music.amazon.com.mx/albums/B07GC98JHG?ref=dm_sh_a074-c8d3-dmcp-495d-87b73&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_kSeA1adOI5ksQJ-IFUVMBxdCIs6qk2Xtc', 'https://www.deezer.com/album/70490662?utm_source=deezer&utm_content=album-70490662&utm_term=2582078102_1560878550&utm_medium=web', 'https://tidal.com/browse/album/93423478', 'img/caratulas/2018_08_09_11_46_48__7509841275545.jpeg', NULL, NULL, 'Han pasado casi 20 años desde que Johnny Indovina comenzó a cantar y actuar en público, y todavía lidera Human Drama con orgullo y pasión, como lo demuestra Cause and Effect originalmente editado en 2002. Esta vez, fuente de inspiración habitual Leonard Cohen , a quien se le reconoce con una versión de cierre de su canción de mediados de los ochenta \"Dance Me to the End of Love\", comparte espacio conEl tributo de Emmylou Harris a su padre, \"Bang the Drum Slowly\". En ambos casos, Indovina hace un gran trabajo, como era de esperar, al sacar a la luz las profundidades potenciales de ambas piezas, con un sonido de banda completa en la última canción y un dominio cercano y tierno sobre la primera. Con un grupo principal de cuatro personas que lo respaldan, incluido el tecladista Mark Balderas , junto con casi 20 artistas invitados, Indovina y el productor Chris Lizote se alejan aún más de cualquier etiqueta de rock gótico a un híbrido más único alternativo inspiracional.', '2020-01-20', '10:12:34', 1, 'DIGITAL', 'Si', 'No', NULL),
(1138, '7509841275552', 'CDDP-7555', 'CDDP', 'Dan García', 'Untitled - Single', '12', '21', '44', 1, 'Si', 'https://open.spotify.com/embed/track/4s4swh0DF8wbcr3nxecU4N', 'https://itunes.apple.com/mx/album/untitled-single/1426590656', 'http://a.co/8mOBELC', NULL, 'https://music.amazon.com.mx/albums/B07GFFXR8D?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_mMkZQKbZ_87PvPpklMCqcnK7eFkCiSFnw&feature=share', 'https://deezer.page.link/S5GeLMtrBEDAZEW98', 'https://listen.tidal.com/album/93546575', 'img/caratulas/2018_08_20_10_07_23__7509841275552.jpg', NULL, NULL, 'Tema compuesto por Dan a piano solo para los que algún día despiertan con tristeza, que buscan sentir que todos somos lo mismo, parte de algo y que no estamos solos, sino todos estamos en esto, hay que vivirlo, experimentarlo y amarlo - Dan García.', '2021-06-18', '19:02:51', 1, 'DIGITAL', 'Si', NULL, NULL),
