(1141, '7509841317931', 'CDFL-1793', 'CDFL', 'Cinema Domingo Orchestra', 'Optical Sounds', '44', '1', '21', 1, 'Si', NULL, 'https://itunes.apple.com/mx/album/optical-sounds/1434331664', NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2018_08_28_10_00_26__7509841317931.jpeg', 'img/caratulas/2018_09_11_08_46_55__cinema domingo orchestra.jpeg', NULL, 'Proyecto audiovisual ideado por el músico Steven Brown en la ciudad de Bruselas, Bélgica, a finales de los años 80. La propuesta consiste en la intervención de espacios públicos por un grupo de músicos y un proyeccionista. Armados con sus instrumentos y con un proyector de 16 mm, musicalizan filmes mudos de las primeras décadas del siglo.\r\nSteven Brown (piano, alientos), Julio García (cordófonos), Bruno Varela (Bajo eléctrico y fretless), Oxama (percusión, electrónica). El álbum incluye la música para las películas: THE REVENGE OF THE CAMERAMAN, TRIADIC BALLET, DESTINY TULIPS SHALL GROW, BALLOON LAND, KID AUTO RACES, SATANS THAPSODY, THE CABINET OF DR. CALIGARI.', '2018-09-11', '08:46:43', 1, 'ACTIVO', 'Si', NULL, NULL),
