(1146, '7509841275613', 'CDDP-7561', 'CDDP', 'Mauricio Sotelo', 'Envés: Cordófonos & Loops', '1', '9', '21', 1, 'Si', 'https://open.spotify.com/album/1RelMeHHKUfqcSAFPxr3yR?si=gAACO9xPSpGBioELkdlwFA', 'https://itunes.apple.com/mx/album/env%C3%A9s-cord%C3%B3fonos-loops/1437294158', 'https://www.amazon.com/dp/B07HPH9DDR/ref=cm_sw_r_cp_ep_dp_5r6SBbEZDR1N4', NULL, 'https://music.amazon.com.mx/albums/B07HPH9DDR', 'https://music.youtube.com/playlist?list=OLAK5uy_nzOexv9tIq0Ts5-O05u8P2uKSBC5Q1V8o', 'https://deezer.page.link/WiSJbTuLbVmkKSnLA', 'https://tidal.com/browse/album/95732344', 'img/caratulas/2018_09_26_09_48_48__7509841275613.jpeg', NULL, NULL, 'Envés compila una serie de grabaciones domésticas en el tránsito personal de Mauricio Sotelo (CABEZAS DE CERA) entre la improvisación y la composición, en ellas explora las cualidades tímbricas de los cordófonos metálicos desde su sonoridad más natural, utilizando el loop no solo como repetidor, sino como elemento determinante en la articulación de la continuidad sonora. \r\nRepercusión acústica de lo intangible, raíz que permanece y vibraciones que  se expanden y crecen como hojas y frutos. Incidencia de un momento, de un ser y su entorno, afuera y adentro.', '2021-01-07', '12:59:45', 1, 'DIGITAL', 'Si', NULL, NULL),
