(1158, '7509841275712', 'CDDP-7571', 'CDDP', 'Susana Zabaleta', 'Desde El Baño (Remasterizado)', '22', '28', '51', 1, 'Si', 'https://open.spotify.com/album/12GNjaPLCLQpVUomyROErh', 'https://itunes.apple.com/mx/album/desde-el-ba%C3%B1o-remasterizado/1444463317', 'http://a.co/d/hNmKSs7', NULL, 'https://music.amazon.com.mx/albums/B07KYFD1XP?ref=dm_sh_6598-3a1e-dmcp-5065-64bae&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_krga0pCSfLE3GBUEI5IIpj_gwX-QRAAh8', 'https://www.deezer.com/album/79913232?utm_source=deezer&utm_content=album-79913232&utm_term=2582078102_1556821014&utm_medium=web', 'https://tidal.com/album/99524740', 'img/caratulas/2018_11_28_12_44_57__7509841275712.jpeg', NULL, NULL, '\"Desde El Baño\" es el segundo álbum de estudio de la cantante mexicana Susana Zabaleta. En palabras de ella, el nombre del álbum: \"Porque consideraba que el baño es el lugar donde una persona es absolutamente libre, no se censura, porque el baño es un lugar para la imaginación, es el \"Disneylandia del alma\". Fue lanzado en 1997 por Consecuencias Publicitarias.', '2020-01-20', '10:19:26', 0, 'DIGITAL', 'Si', NULL, NULL),
(1159, '7509841275729', 'CDDP-7572', 'CDDP', 'Susana Zabaleta', 'Navidad', '22', '28', '51', 1, 'Si', 'https://open.spotify.com/album/7zhz8E6N4XwV3KfMT5JmTi', 'https://itunes.apple.com/mx/album/navidad/1444467132', 'http://a.co/d/ePUQnox', NULL, 'https://music.amazon.com.mx/albums/B07KYDS5DZ?ref=dm_sh_fc46-ede9-dmcp-370d-2f853&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_mg9ZTL30qk5lEHCuhkak8CjsunD63MERg', 'https://www.deezer.com/album/79913982?utm_source=deezer&utm_content=album-79913982&utm_term=2582078102_1556821303&utm_medium=web', 'https://tidal.com/album/99521363', 'img/caratulas/2018_11_28_12_45_02__7509841275729.jpeg', NULL, NULL, 'Album dedicado a las canciones más conocidas de la época Navideña. Producido por Euganio Toussaint, grabado por Alejandro Rodríguez y masterizado por Luis Gil.\r\n\"Piano: Eugenio Toussaint\r\nGuitarra: Paco Rosas Bajo: Pancho Ruiz\r\nBatería y Percusiones: Beto Domínguez\r\nSax: Alejandro Campos\". Lanzado por Consecuencias Publicitarias en el año 2002', '2020-01-20', '10:19:28', 0, 'DIGITAL', 'Si', NULL, NULL),
(1160, '7509841275736', 'CDDP-7573', 'CDDP', 'Susana Zabaleta', 'Quiero Sentir Bonito', '22', '28', '51', 1, 'Si', 'https://open.spotify.com/album/4N2mYRiI1P4cv3JB5gk0vE', 'https://itunes.apple.com/mx/album/quiero-sentir-bonito/1444470300', 'http://a.co/d/3WqWpA2', NULL, 'https://music.amazon.com.mx/albums/B07KYFQ7TY?ref=dm_sh_a360-0f91-dmcp-737d-927e1&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_lsScPv0CaERcv8rcfJpIeOPwqmKHkuJiE', 'https://www.deezer.com/album/79908102?utm_source=deezer&utm_content=album-79908102&utm_term=2582078102_1556821551&utm_medium=web', 'https://tidal.com/album/99521375', 'img/caratulas/2018_11_28_12_45_06__7509841275736.jpeg', NULL, NULL, 'Disco muy conocido de la cantante y actriz Susana Zabaleta. Producido por Guillermo Gil, Luis Carlos Esteban y Armando Manzanero, grabado por Chacho Pineda.\r\n\"Pianos, Sintes y Programación: Jordi Bachbush\r\nGuitarras: David ?The Rod? Rodríguez\"\r\nLanzado en el año 2004 por Consecuencias Publicitarias', '2020-01-20', '10:19:29', 0, 'DIGITAL', 'Si', NULL, NULL),
(1161, '7509841275743', 'CDDP-7574', 'CDDP', 'Susana Zabaleta', 'Para Darle Cuerda al Mundo (en vivo)', '22', '28', '51', 1, 'Si', 'https://open.spotify.com/album/6Q0Hzm110RDkxNo15kcv9v', 'https://itunes.apple.com/mx/album/para-darle-cuerda-al-mundo-en-vivo/1444474067', 'http://a.co/d/9WJeYQC', NULL, 'https://music.amazon.com.mx/albums/B0013SD5VY?ref=dm_sh_450a-b3f2-dmcp-69c7-ff436&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_l9DWXM6IMKCr52EUKHOWQX9RozUSB2toA', 'https://www.deezer.com/album/79908272?utm_source=deezer&utm_content=album-79908272&utm_term=2582078102_1556821442&utm_medium=web', 'https://tidal.com/album/99522315', 'img/caratulas/2018_11_28_12_48_35__7509841275743.jpeg', NULL, NULL, 'Canciones de la gran Liliana Felipe y Jesusa Rodríguez. Album grabado en la Sala Nezahualcóyotl del Centro Cultural Universitario de la Universidad Autónoma de México, Ciudad de México y producido por Susana Zabaleta.\r\nGrabado por Humberto Terán, Fernando Blu, Alex Carrera. \"Piano: Dimitri Dudin\r\nPiano: Mauricio Nader\". Lanzado por Consecuencias Publicitarias en el año 2005', '2020-01-20', '10:19:30', 0, 'DIGITAL', 'Si', NULL, NULL),
(1162, '7509841275750', 'CDDP-7575', 'CDDP', 'Susana Zabaleta', 'De la A a la Z', '22', '28', '51', 1, 'Si', 'https://open.spotify.com/album/0bIOfmxlbeojmT2WdcH7XH', 'https://itunes.apple.com/mx/album/de-la-a-a-la-z/1444476037', 'http://a.co/d/eNdMPAq', NULL, 'https://music.amazon.com.mx/albums/B07KYDQ6L6?ref=dm_sh_487a-ed70-dmcp-ec54-fec20&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_lt7pKFp-ocIrYHRP-CkkruLWCmQYq1xvs', 'https://www.deezer.com/album/79913512?utm_source=deezer&utm_content=album-79913512&utm_term=2582078102_1556820778&utm_medium=web', 'https://tidal.com/album/99522326', 'img/caratulas/2018_11_28_12_54_56__7509841275750.jpeg', NULL, NULL, 'Disco histórico a dúo entre el maestro Armando Manzanero y Susana Zabaleta. Grabado totalmente en vivo por Chacho Peniche. Temas de Manzanero, José Alfredo, Raúl Ornelas y Liliana Felipe & Jesusa Rodríguez. Piano: Mateo Aguilar, Batería: Ricardo Erdos, Sax: Alberto Delgado, Bajo: Paolo Marcellini, Guitara Acústica: Marco Morel. Producido por Susana Zabaleta / Rossy Pérez Navarro. Lanzado en el 2006 por Consecuencias Publicitarias.', '2020-01-20', '10:19:32', 0, 'DIGITAL', 'Si', NULL, NULL),
(1163, '7509841275767', 'CDDP-7576', 'CDDP', 'Susana Zabaleta', 'Quiero Sentir Más Bonito', '22', '28', '51', 1, 'Si', 'https://open.spotify.com/album/4eC0sfRhxnGL9CtB94OWTE', 'https://itunes.apple.com/mx/album/quiero-sentir-m%C3%A1s-bonito/1444477785', 'http://a.co/d/flT7OCx', NULL, 'https://music.amazon.com.mx/albums/B07KYD2LPW?ref=dm_sh_ada7-9dc4-dmcp-9a0b-d58cb&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_k5HXk9SFyLCepJ775PREEn1WUeZO2DbxU', 'https://www.deezer.com/album/80187422?utm_source=deezer&utm_content=album-80187422&utm_term=2582078102_1556821679&utm_medium=web', 'https://tidal.com/album/99840943', 'img/caratulas/2018_11_28_12_57_36__7509841275767.jpeg', NULL, NULL, 'Susana nació el 30 de septiembre de 1964, en Monclova, Coahuila, México. Estudió música en Roma, Florencia e Italia y estudió Opera en la Escuela Superior de Música en Monterrey. Decidió viajar a la ciudad para superarse profesionalmente. Sus estudios los continúo en la escuela Ollin Yoliztli. En la parte de musical se inició con la presentación al lado de la Orquesta de Cámara en la sala del colegio de música. Luego estuvo en operas como ?La traviata?, ?Elixir de amor?, ?Dido y Arenas?. Cuando estuvo en ?Quien es quien?, fue una perfecta oportunidad de demostrar cuan talentosa era, alternando la actuación y el canto. Este álbum complementa el anterior \"Quiero Sentir Bonito\" editado en el año 2017 por Consecuencias Publicitarias de la mano de Rossy Pérez.', '2020-01-20', '10:19:33', 0, 'DIGITAL', 'Si', NULL, NULL),
(1164, '7509841275774', 'CDDP-7577', 'CDDP', 'Susana Zabaleta', 'Te Busqué', '22', '28', '51', 1, 'Si', 'https://open.spotify.com/album/7hQV2bL5KUgQ8l5UzGqjGu', 'https://itunes.apple.com/mx/album/te-busqu%C3%A9/1444478677', 'http://a.co/d/e1Mk0I8', NULL, 'https://music.amazon.com.mx/albums/B07KYF396L?ref=dm_sh_9696-2786-dmcp-8c57-e7d68&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_nxelTT1CFi73YeGmn06_5cejroyUyW-00', 'https://www.deezer.com/album/80195172?utm_source=deezer&utm_content=album-80195172&utm_term=2582078102_1556821844&utm_medium=web', 'https://tidal.com/album/99840975', 'img/caratulas/2018_11_28_13_01_00__7509841275774.jpeg', NULL, NULL, 'Disco de estudio producido por Gabriel González Meléndez, grabado por Gerardo Rocha y masterizado por Luis Gil. Fue grabado en El Cielo Studios, SoundStation, Ander Studios, Monterrey, Nuevo León, México y lanzado por Consecuencias Publicitarias en el año 2007.', '2020-01-20', '10:19:35', 0, 'DIGITAL', 'Si', NULL, NULL),
