(1169, '7509841275811', 'CDDP-7581', 'CDDP', 'Combo Movox', 'Combo Movox (EP)', '36', '35', '33', 1, 'Si', 'https://open.spotify.com/album/5SxLR1YW9FIyWTGJflHlo1?si=FkAYoc0XS1u-lSQbg2P0Lw', 'https://itunes.apple.com/mx/album/combo-movox-ep/1444781103', 'https://www.amazon.com/dp/B07KX99BP9/ref=cm_sw_r_cp_ep_dp_S9PcCbDW4N47E', NULL, 'https://music.amazon.com.mx/albums/B07KX99BP9', 'https://music.youtube.com/playlist?list=OLAK5uy_kz10jzmP-xbi--2631Rn4VdUJFAyR7-qM', 'https://deezer.page.link/T13diwsRQECh6f4N7', 'https://tidal.com/browse/artist/10675372', 'img/caratulas/2018_12_07_08_27_54__7509841275811.jpeg', NULL, NULL, 'Combo Movox es un proyecto musical en el cual el Sr.\r\nGonzález, conocido miembro de la agrupación Botellita de\r\nJerez y con una larga trayectoria solista, compone, toca y\r\nproduce, temas que son interpretados por la inigualable voz de Zaira Franco, cantante cuya trayectoria involucra su incursión en diferentes géneros musicales y un disco solista. En el proyecto están involucrados viejos aliados de los trabajos anteriores del Sr. González. De esta manera une fuerzas junto a Fratta (Bajo), Eduardo Dyer (Piano Rhodes), Chatrán (Percusión) y Santiago Ortiz (Multi-percusión), además de acudir a nuevos colaboradores como PaTo Montes (Guitarra) de Maldita Vecindad, de su compañero en Botellita de Jerez Francisco Barrios ?El Mastuerzo? (Percusión corporal) y desde Uruguay, el rapero Fernando Santullo, ex integrante del Peyote Asesino.', '2020-09-30', '12:50:22', 1, 'DIGITAL', 'Si', NULL, NULL),
