(1179, '7509841275927', 'CDDP-7592', 'CDDP', 'Jesús Echevarría', 'Amor La Dulce Muerte', '7', '32', '49', 1, 'Si', 'https://open.spotify.com/album/3iPsB6tY81vr4SKk1z66uW?si=L4LpJOC-TIWcRp5ai63oCw', 'https://itunes.apple.com/mx/album/amor-la-dulce-muerte-with-lourdes-ambriz-ensamble-son%C3%A9/1451994112', 'https://www.amazon.com/Amor-Dulce-Muerte-Jes%C3%BAs-Echevarr%C3%ADa/dp/B07NN91LZZ/ref=sr_1_5?ie=UTF8&qid=1550173467&sr=8-5&keywords=jesus+echevarria', NULL, 'https://music.amazon.com.mx/albums/B07NN91LZZ', 'https://music.youtube.com/playlist?list=OLAK5uy_mX-3pnggZpoqd9ep3ZcEi4nhVTL3Gbo_w', 'https://deezer.page.link/B51iGW5GbSnB7oCPA', 'https://tidal.com/browse/album/103971946', 'img/caratulas/2019_02_12_12_31_36__7509841275927.jpeg', NULL, NULL, 'Amor la dulce muerte y Canciones cotidianas, de humor y extraordinarias. Un proyecto de Jesús Echevarría, compositor mexicano de un largo catálogo de obras para orquesta sinfónica, ensambles de cámara, ciclos de canciones, música coral, y música incidental para cine y teatro. Obtuvo el premio Mejor Música de Pantalla de Cristal 2017 por la serie para TV Melchor Ocampo de Guita Shifter. En noviembre de 2017 estrenó su obra Ex Libris sonoro para orquesta sinfónica en el marco del 150 aniversario de la Biblioteca Nacional con la Orquesta de la Preparatoria Nacional dirigida por el maestro Luis Samuel Saloma\r\nEn esta obra cuenta con el Ensamble SonÉ (feauturing) Lourdes Ambriz, soprano. María Valle, violoncello. Jaime Ruiz, arpa. Enrique Nieto, percusiones. Jesús Echevarría, guitarras. Ulises Basurto, narrador.\r\n', '2020-09-30', '12:23:22', 1, 'DIGITAL', 'Si', NULL, NULL),
