(1201, '7509841276139', 'CDDP-7613', 'CDDP', 'Alejandro Jodorowsky', 'Zaratustra', '44', '49', '49', 1, 'Si', 'https://open.spotify.com/album/12ehIKLVoVwrFLGO11gl7r', 'https://itunes.apple.com/mx/album/zaratustra/1462665831', 'https://www.amazon.com/Zaratustra-Original-Cast-Recording-Explicit/dp/B07RXDKCLY/ref=sr_1_3?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&keywords=Alejandro+Jodorowsky&qid=1559323065&s=dmusic&sr=1-3', NULL, 'https://music.amazon.com.mx/albums/B07RXDKCLY?ref=dm_sh_a8ec-564f-dmcp-6aa7-e36ba&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_kR6zaevbCR7TH3MaAguBE2g3nvwzewrXM', 'https://www.deezer.com/album/96315982?utm_source=deezer&utm_content=album-96315982&utm_term=2582078102_1557418375&utm_medium=web', 'https://tidal.com/album/109036928', 'img/caratulas/2019_05_07_13_01_26__7509841276139.jpeg', NULL, NULL, 'De la época de oro de Alejandro Jodorowsky en México, surge este álbum. Una espléndida y respetuosa digitalización del acetato original de \"Zaratustra\". Este singular montaje discográfico, basado en su obra cumbre de teatro, contiene las voces de los actores, incluyendo el famoso monólogo de Carlos Ancira y la música lúdica de \"Las Damas Chinas\", todos del elenco original. \r\nMuy recomendable para ver los conceptos que ya manejaba Jodorowsky en 1970.', '2020-01-20', '10:49:19', 1, 'DIGITAL', 'Si', NULL, NULL),
