(1229, '7509841317955', 'CDFL-1795', 'CDFL', 'Roberto Limón', 'Milonga Feroz', '7', '21', '49', 1, 'Si', 'https://open.spotify.com/album/3Umzwvc8l2UuJe79R6W7wp?si=61eE-Ux0S5qjvGU-HQ10Iw', 'https://music.apple.com/mx/album/milonga-feroz/1474841793', 'https://www.amazon.com/Milonga-Feroz-Roberto-Lim%C3%B3n/dp/B07W1NKVSW/ref=sr_1_1?keywords=roberto+limon+milonga&qid=1564763371&s=gateway&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B07W1NKVSW?ref=dm_sh_712d-33f4-dmcp-39e6-fb109&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_mB0J_gLK4kiIbCOmbMTReqR52s-wg215I', 'https://www.deezer.com/album/105619812?utm_source=deezer&utm_content=album-105619812&utm_term=2582078102_1564763429&utm_medium=web', 'https://tidal.com/browse/album/114342728', 'img/caratulas/2019_07_30_08_56_05__7509841317955.png', NULL, NULL, 'Guitarra y bandoneón; guitarra y cuarteto de cuerdas; guitarra y oboe: guitarra y flauta; guitarra y percusiones afrolatinas; guitarra y canto. En este álbum la guitarra es El Centro. Roberto Limón, con la excelencia. la ductilidad y el sonido que lo caracterizan nos sumerge en paisajes sonoros y estilísticos diversos, que forman parte del ADN cultural de Latinoamérica. El relato sonoro comienza en el punto más austral - Argentina y Chile - aborda la magia rítmica o afrocaribeña de Puerto Rico y culminan en México, el punto más septentrional de la Patria Grande. Y haciendo honor a nuestra cultura latinoamericana, el álbum incluye dos referencias literarias: un concierto en homenaje a Octavio Paz y un poema de Jorge Luis Borges.', '2020-01-20', '11:09:12', 1, 'ACTIVO', 'Si', NULL, NULL),
