(1327, '7509841277389', 'CDDP-7738', 'CDDP', 'El Mastuerzo y Los Jijos del Maiz', 'Suite: Cuando me da la Depre (EP)', '36', '49', '49', 1, 'Si', 'https://open.spotify.com/album/0D1iZUrgA6Hru4nevHQOyH?si=5YHpeMXYS9-Qkh86Y1b6rw', 'https://music.apple.com/mx/album/suite-cuando-me-da-la-depre-ep/1513222736', 'https://www.amazon.com/-/es/Mastuerzo-Los-Jijos-del-Maiz/dp/B088NKV549/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=El+Mastuerzo+y+Los+Jijos+del+Maiz+Suite%3A+Cuando+me+da+la+Depre&qid=1590128073&s=dmusic&sr=1-1', NULL, 'https://music.amazon.com.mx/albums/B088NKV549?ref=dm_sh_ad88-328e-dmcp-5075-83f5d&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_kERt3daqHn4v6E-329uhRgYYwIkPKFmxA', 'https://www.deezer.com/album/148487992?utm_source=deezer&utm_content=album-148487992&utm_term=2582078102_1590127165&utm_medium=web', 'https://tidal.com/browse/album/141572921', 'img/caratulas/2020_05_21_18_49_31__7509841277389.jpeg', NULL, NULL, 'Francisco Barrios ?El Mastuerzo? es fundador del grupo Botellita de Jerez que nació en 1983, como alternativa del rock en México. Con su innovadora fusión de ritmos populares mexicanos, denominaron su música como guacarrock. Luego de una larga trayectoria en la música y tras cinco discos como solista, Francisco Barrios ?El Mastuerzo? encabeza una nueva propuesta musical, que responde al nombre de ?El Mastuerzo y Los Jijos del Maíz?. Este nuevo lanzamiento ?Suite: Cuando me da la\r\ndepre? es el segundo corte de temas después del primer single ?El Tecolote Fisgón? que formarán la segunda producción de estudio de este proyecto.', '2020-05-21', '23:13:36', 1, 'DIGITAL', 'Si', NULL, NULL),
