(1331, '7509841277426', 'CDDP-7742', 'CDDP', 'Real de Catorce', 'XXXVII Aniversario (En Vivo) (EP)', '3', '35', '49', 1, 'Si', 'https://open.spotify.com/album/6mlm6H6MwhpPJ3dzovobnc?si=a31eD5ntRrSewgZJ9vf6Ow', 'https://music.apple.com/mx/album/xxxvii-aniversario-en-vivo-ep/1514463987', 'https://www.amazon.com/-/es/XXXVII-Aniversario-Vivo-Real-Catorce/dp/B088XZDBPN/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=Real+de+Catorce+XXXVII+Aniversario&qid=1590730785&s=dmusic&sr=1-1', NULL, 'https://music.amazon.com.mx/albums/B088XZDBPN?ref=dm_sh_c79e-5edf-dmcp-a955-41ab9&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_lP6LcGAAjdDreIB49WqO_nNM_qeJKTDnw', 'https://www.deezer.com/album/149649552?utm_source=deezer&utm_content=album-149649552&utm_term=2706165622_1590731031&utm_medium=web', 'https://tidal.com/browse/album/142289173', 'img/caratulas/2020_05_26_09_38_50__7509841277426.jpeg', NULL, NULL, 'Grabado totalmente en directo el sábado 14 de diciembre de 2019, el grupo Real de Catorce liderado por su fundador José Cruz, festeja su aniversario 37 con un concierto que se irá editando para los fans. Éste es el primer corte de este festejo de la banda precursora del blues en México que incluye 2 éxitos ?Al Rojo de la Tarde? y ?Blues del Atajo?. En 2012 su música fue declarada patrimonio artístico por la Fonoteca Nacional.', '2020-05-29', '09:19:26', 1, 'DIGITAL', 'Si', NULL, NULL),
