(1336, '7509841277471', 'CDDP-7747', 'CDDP', 'Marcos Lizama', 'Canciones para Un Niño Como Tú', '20', '49', '49', 1, 'Si', 'https://open.spotify.com/album/0QGz7v3ElvOwZ0NWFbbbaU?si=FrGY-czVSHqMIyUS2M_8Kg', 'https://music.apple.com/mx/album/canciones-para-un-ni%C3%B1o-como-t%C3%BA/1517892633', 'https://www.amazon.com/-/es/dp/B08B3M9H22/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=Marcos+Lizama+Canciones+para+Un+Ni%C3%B1o+Como+T%C3%BA&qid=1591945212&s=dmusic&sr=1-1', NULL, 'https://music.amazon.com.mx/albums/B08B3M9H22?ref=dm_sh_9d17-a78d-dmcp-c7bb-6164f&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_lN9YDG0dPgq65L_yn7iTHIQZ4cCtIP_sU', 'https://www.deezer.com/album/154220392?utm_source=deezer&utm_content=album-154220392&utm_term=2706165622_1591945362&utm_medium=web', 'https://tidal.com/browse/album/144843432', 'img/caratulas/2020_06_11_09_30_56__7509841277471.jpeg', NULL, NULL, 'Joven, adulto, viejo, harán vibrar emociones prístinas de dichosos días: el hogar, el cariño materno, la escuela, los primeros amigos, los primeros conocimientos y satisfacciones.\r\nImaginado en servicio de la niñez mexicana - de la educación mexicana - el álbum ofrecido por la maestra Belén Ventura de Olivares brinda estímulos, lecciones y esparcimiento a los hogares de México y del Mundo. AGUSTÍN YAÑEZ (Miembro de El Colegio de México y Director de la Academia Mexicana Correspondiente de la Española).\r\n\r\nGrabado y producido en 1973 por Victor Rapoport.', '2020-09-01', '10:09:11', 1, 'DIGITAL', 'Si', NULL, NULL),
(1337, '7509841277402', 'CDDP-7740', 'CDDP', 'Miguel Inzunza', 'Donde Paraba El Viento', '6', '49', '49', 1, 'Si', 'https://open.spotify.com/album/64Plkzykp1SXqVsnoA3CDD?si=KzU6ZG3fTfWj1tRdbTBtdg', 'https://music.apple.com/mx/album/donde-paraba-el-viento-single/1518322064', 'https://www.amazon.com/-/es/Miguel-Inzunza/dp/B08B7R12NR/ref=sr_1_2?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=miguel+inzunza&qid=1592545476&sr=8-2', NULL, 'https://music.amazon.com.mx/albums/B08B7R12NR?ref=dm_sh_6368-9edc-dmcp-b03b-bd5fb&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_m5fK6NUZ9m3-9ZK7PpGDVJ86v1NKi0K84', 'https://www.deezer.com/album/154861892?utm_source=deezer&utm_content=album-154861892&utm_term=2582078102_1592545437&utm_medium=web', 'https://tidal.com/browse/album/145233700', 'img/caratulas/2020_06_12_13_56_49__7509841277402.jpeg', NULL, 'https://www.youtube.com/watch?v=e_Kwkf7V1uQ', 'Nuevo single del cantautor Miguel Inzunza, compuesta por él mismo junto con Pavel Nuñez.\r\nCompositor, cantante y productor mexicano, nominado al Latín Grammy en 2018 en la categoría de productor. Fusiona géneros y ritmos diversos que dan como resultado un sonido alternativo, fresco y emotivo, en el que la canción es hilo conductor y a la vez protagonista. Comprometido con las letras, va desde lo mas desenfadado a lo mas reflexivo, imprimiendo siempre frescura y actualidad como características principales.\r\nSobresale como característica el uso de la tecnología al servicio de la canción, y en su búsqueda incorpora timbres electrónicos, loops e instrumentos acústicos en una amalgama sonora de personalidad modernista y al mismo tiempo emotiva.\r\nHa participado en un vasto número de festivales culturales y ferias literarias de Mexico e Iberoamérica, llevando una propuesta que transita sin etiquetas entre lo cultural y lo popular.', '2020-06-18', '23:01:55', 1, 'DIGITAL', 'Si', NULL, NULL),
(1338, '7509841277488', 'CDDP-7748', 'CDDP', 'Los Rude Boys', 'Tiembla La Tierra', '43', '33', '31', 1, 'Si', 'https://open.spotify.com/album/568PprqRhenozECa1D92JH?si=0V1vQtCETb-AjC3QPCZwPw', 'https://music.apple.com/mx/album/tiembla-la-tierra/1519063108', 'https://www.amazon.com/-/es/Tiembla-Tierra-Explicit-Rude-Boys/dp/B08BJL2D47/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=rude+boys+tiembla+la+tierra&qid=1593187247&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B08BJL2D47?ref=dm_sh_2c0f-df28-dmcp-51c5-d94e6&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_ldA6GKd8W7QN13LhB1j4s9Su7pT6k4-jI', 'https://www.deezer.com/album/155886312?utm_source=deezer&utm_content=album-155886312&utm_term=2582078102_1593187302&utm_medium=web', 'https://tidal.com/browse/album/145844743', 'img/caratulas/2020_06_25_10_04_22__7509841277488.jpeg', NULL, 'https://www.youtube.com/watch?v=gZijKFKJhcg', 'Una reedición de su tercer material discográfico nos muestra la evolución en esta magnifica agrupación, un álbum que incluye 7 temas los cuales ya han estado dentro del gusto de sus seguidores, un álbum compuesto, arreglado, producido, por u singular líder Elfego Sanchez\r\nRivera quien a fundado esta banda desde el año 2000, sin duda un paso mas grande a la historia de esta banda.', '2020-06-26', '12:13:39', 1, 'DIGITAL', 'Si', NULL, NULL),
(1339, '7509841277501', 'CDDP-7750', 'CDDP', 'Zaira Franco', 'Soy Arena - Single', '22', '51', '49', 1, 'Si', 'https://open.spotify.com/album/1Q09QNHm1IvrxNMa8Fzf4f?si=ecdB5b4sQciuAsY99mwOsA', 'https://music.apple.com/mx/album/soy-arena-single/1519076499', 'https://www.amazon.com/-/es/Zaira-Franco/dp/B08BF8VP1C/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=zaira+franco+soy+arena&qid=1593187585&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B08BF8VP1C?ref=dm_sh_15c6-edf2-dmcp-aa7a-20bce&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_mv1ylvN6eevtysJgG2VU1c7BRdVxtCJjU', 'https://www.deezer.com/album/155361672?utm_source=deezer&utm_content=album-155361672&utm_term=2582078102_1593187670&utm_medium=web', 'https://tidal.com/browse/album/145506991', 'img/caratulas/2020_06_25_10_08_29__7509841277501.jpeg', NULL, 'https://www.youtube.com/watch?v=o56idqBclr0', 'La más reciente producción de Zaira Franco \"Soy Arena\". Un tema playero para el verano, el quédate en casa y la insoportable levedad del ser. Zaira es una cantante y compositora dinámica con más de 20 años de trayectoria que sorprende por la versatilidad y goce con la que aborda con un sonido muy propio, diferentes géneros. La poesía unida a la música es su principal herramienta para expresar su manera de sentir la vida. Ha recorrido Europa y América Latina  con su música llena de sensualidad, belleza, reflexión y poesía.', '2020-06-26', '12:13:39', 1, 'DIGITAL', 'Si', NULL, NULL),
