(1341, '7509841277518', 'CDDP-7751', 'CDDP', 'Gorrión Serrano', 'Todo Es Horizonte y Cielo', '14', '15', '49', 1, 'Si', 'https://open.spotify.com/album/7kjEF0BIk5LXmaZNJpUBzy?si=OEDScd2kTnegoFbFPUk7aw', 'https://music.apple.com/mx/album/todo-es-horizonte-y-cielo/1521539212', 'https://www.amazon.com/-/es/Todo-Es-Horizonte-y-Cielo/dp/B08C6XXCJR/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=Gorri%C3%B3n+Serrano+Todo+Es+Horizonte+y+Cielo&qid=1594400963&s=dmusic&sr=1-1', NULL, 'https://music.amazon.com.mx/albums/B08C6XXCJR?ref=dm_sh_a2d0-1e46-dmcp-6e60-9e5c0&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_km3WZTWPKpug659wU6QY9fWcYKJ4h-qdU', 'https://www.deezer.com/album/158190332?utm_source=deezer&utm_content=album-158190332&utm_term=2706165622_1594401204&utm_medium=web', 'https://tidal.com/browse/album/147104932', 'img/caratulas/2020_07_08_10_18_25__7509841277518.jpg', NULL, NULL, 'A NUESTRO GORRIÓN SERRANO                                                  \r\nNO SE LE PUEDE ACUSAR\r\nDE QUE CANTA POR CANTAR\r\nO DE CARECER DE ARCANO.\r\nSU CANTO ES PROPIO Y CERCANO\r\nPORQUE ES ENRAIZADO ANHELO;\r\nPARA UN GORRIÓN QUE ALZA EL VUELO\r\nY FIRMEMENTE ALETEA,\r\nTODO ES HORIZONTE Y CIELO\r\nA RIESGO DE LO QUE SEA.\r\n\r\nA las tupidas y ralas\r\nvibra ya su canto ufano \r\ny sus armonías y escalas,\r\nsu feeling tan meridiano,\r\nle dan cada vez más alas\r\nA NUESTRO GORRIÓN SERRANO\r\n\r\nDe prejuicios vacunado,\r\neste gorrión, sin chistar,\r\npone un Caimán zapateado\r\ncon Mozart a dialogar,\r\ny de un gorjeo desganado\r\nNADIE LO PUEDE ACUSAR\r\n\r\nA un  gorrión, igual que a un mirlo,\r\ncuando se sabe entregar\r\nno es posible desmentirlo\r\ny en serio no hay que tomar\r\na quien se queje al oírlo\r\nDE QUE CANTA POR CANTAR\r\n\r\n\r\n\r\n                                                                                                           - 2 -\r\n\r\nArraigo no es geografía\r\nni orígen alarde vano,\r\ny prodigar alegría\r\nen la urbe o a campo llano\r\nno es indicio de herejía\r\nO DE CARECER DE ARCANO\r\n\r\nSea un aire de serranía\r\no un gustito calentano,\r\ntodo suena a epifanía\r\nno a desplante culterano;\r\nrebozante de armonía\r\nSU CANTO ES PROPIO Y CERCANO\r\n\r\nGorrión que aprende a beber\r\nagua limpia del subsuelo,\r\nsed no habrá de padecer\r\ny hasta en sus trances de duelo\r\nirradia vida su ser\r\nPORQUE ES ENRAIZADO ANHELO\r\n\r\ny en busca de porvenir, \r\nal elevarse del suelo\r\nsu canto empieza a fluir,\r\ntodo es enigma o señuelo\r\ny mundo por descubrir\r\nPARA UN GORRIÓN QUE ALZA EL VUELO\r\n\r\n\r\n\r\n\r\n\r\n                                                                                                      - 3 -\r\nNuestro gorrión es así:\r\nchilango y no se chivea;\r\n¡chale!, ¡chido! (I like le dí)\r\npara nada titubea,\r\nse siente dueño de sí\r\nY FIRMEMENTE ALETEA\r\n\r\nSi entre lo rural y urbano\r\nsu perfil yo les troquelo,\r\n¡es un gran trío mexicano!\r\ny como diría mi abuelo:\r\nya para el Gorrión serrano\r\nTODO ES HORIZONTE Y CIELO.\r\n\r\nSe le oye huapanbluseando\r\ny de pronto hasta jazzea,\r\nen días casi taloneando,\r\notros por nota solfea\r\ny continuará cantando\r\nA RIESGO DE LO QUE SEA.\r\n\r\n                        Guillermo Velázquez B.\r\n                         Juglar de fiesta y quebranto\r\n                         Febrero del 2020\r\n', '2020-07-10', '09:58:51', 1, 'DIGITAL', 'Si', NULL, NULL),
