(1348, '7509841277563', 'CDDP-7756', 'CDDP', 'Gastón Artigas', 'Panacea del Sonámbulo', '12', '24', '49', 1, 'Si', 'https://open.spotify.com/album/6YSGLzWlOC7JXzfPZLunHq?si=CueqbQ9bQnu41FxQ6DdHyw', 'https://music.apple.com/mx/album/panacea-del-son%C3%A1mbulo/1523099937', 'https://www.amazon.com/-/es/gp/product/B08CXFX1TQ/ref=dm_ws_sp_ps_dp', NULL, 'https://music.amazon.com.mx/albums/B08CXFX1TQ?ref=dm_sh_512c-20ab-dmcp-0529-e320e&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_nlguO_bJmYjj8AhjkX1AcR8lxmf_u6cLs', 'https://www.deezer.com/album/160595882?utm_source=deezer&utm_content=album-160595882&utm_term=2582078102_1595568314&utm_medium=web', 'https://tidal.com/browse/album/148555419', 'img/caratulas/2020_07_22_13_14_21__7509841277563.jpeg', NULL, NULL, '?Panacea del sonámbulo? es el primer trabajo solista del multi-instrumentista y compositor Gastón Artigas. Compuesto, interpretado y grabado en su totalidad por el autor en México durante los primeros meses de la pandemia que detuvo al mundo durante el 2020, el concepto del disco gira alrededor de la paz, la paciencia, el amor propio, y generar un eje de introspección y vibraciones positivas. Todo esto lo logra con un discurso musical en donde el Lo-Fi, el instrumental de hip-hop y la improvisación devenida del jazz se complementan, mezclando las texturas electrónicas con clarinetes, flautas y saxofones, elaborando composiciones desarrolladas con un discurso humilde, delicado y armonioso, que pretende despertar la calma interior y llenar de energía creativa y constructiva a sus oyentes.', '2020-07-24', '11:35:06', 1, 'DIGITAL', 'Si', NULL, NULL),
