(1354, '7509841277662', 'CDDP-7766', 'CDDP', 'Son de Aquí', 'Deja El Celular - Single', '15', '41', '49', 1, 'Si', 'https://open.spotify.com/album/0lhSbiLmSNvW5ock5T7n86?si=w8s7qW6TSZWL2zyxnhtnJw', 'https://music.apple.com/mx/album/deja-el-celular-single/1526503544', 'https://www.amazon.com/-/es/Son-Aqu%C3%AD/dp/B08FD1SSYN/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=Son+de+Aqu%C3%AD+Deja+El+Celular&qid=1597419166&s=dmusic&sr=1-1', NULL, 'https://music.amazon.com.mx/albums/B08FD1SSYN?ref=dm_sh_35b7-9c6c-dmcp-02c1-e8628&musicTerritory=MX&marketplaceId=A1AM78C64UM0Y8', 'https://music.youtube.com/playlist?list=OLAK5uy_kD43P3tFUUJL5zEcO93aQxOQ4nUCOLkt8', 'https://www.deezer.com/album/165643972?utm_source=deezer&utm_content=album-165643972&utm_term=2706165622_1597419579&utm_medium=web', 'https://tidal.com/browse/track/151275751', 'img/caratulas/2020_08_12_09_11_49__7509841277662.jpeg', NULL, NULL, 'Son de Aquí es una banda de música latina originaria de la Ciudad de México. Su música es\r\nexplosiva, fiestera y bailable y se inspira en los vínculos que comparten las músicas\r\ntradicionales de México, Cuba y Colombia incorporando también elementos más actuales\r\ncomo hip hop y electrónica.\r\nLa banda tiene dos discos ?Traigo Sabor? (2005) ?De aquí son? (2015) y en 2020 están\r\nlanzando un nuevo sencillo. Ha participado en los festivales y foros más importantes de\r\nMéxico, siendo invitada a Europa en diferentes ocasiones.\r\nSon de Aquí siempre ha estado en constante colaboración con distintos músicos de diferentes\r\npartes del mundo. Desde el 2016 han estado colaborando con músicos de Grecia, Alemania,\r\nEspaña y Holanda realizando giras por europa y grabando nueva música. ?Deja el celular? es el primer sencillo de lo que será el tercer disco de la banda. El tema fue\r\ngrabado en Alemania, Holanda y México en colaboración con músicos de México, Grecia,\r\nAlemania y Holanda, producido por Pablo Todd. Fue compuesto por Leonardo Prieto,\r\ndirector y fundador de la banda, influenciado por ritmos latinos como la timba y el reggaeton\r\nasí como por el hip hop y la electrónica. El tema habla sobre la sobre información y uso\r\nexcesivo del celular, las redes sociales y la tecnología en general invitando a la gente a\r\nrecontar y encontrarse en la vida real.', '2020-08-14', '09:31:07', 1, 'DIGITAL', 'Si', NULL, NULL),
