(1359, '7509841277648', 'CDDP-7764', 'CDDP', 'Monocordio, Leo Soqui, Amandititita', 'Después del Fin del Mundo', '36', '6', '18', 1, 'Si', 'https://open.spotify.com/album/4i0YCmrYjaL70AGJIoH5ks?si=xkQD7UYmQ6ScOjzA_4aiWg', 'https://music.apple.com/mx/album/despu%C3%A9s-del-fin-del-mundo-single/1527147142', 'https://www.amazon.com/Despu%C3%A9s-del-Fin-Mundo/dp/B08FRTQDS7/ref=sr_1_1?dchild=1&keywords=despues+del+fin+del+mundo+monocordio&qid=1598506458&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B08FRTQDS7', 'https://music.youtube.com/playlist?list=OLAK5uy_ltgOfhCMHBMsr8mKh2MbNqmx48l1sQbsA', 'https://deezer.page.link/muiihu2DjLauD86A7', 'https://tidal.com/browse/album/151842048', 'img/caratulas/2020_08_26_10_03_04__7509841277648.jpeg', NULL, 'https://www.youtube.com/watch?v=wMR1-kJcURI', '¿Es una cumbia? ¿Es un hip hop? ¿Es un reguetón? Difícil saberlo, lo cierto es que es una canción de Fernando Rivera Calderón en colaboración con Amandititita y el reconocido productor Leo Soqui, que nos propone reír y bailar y hacernos la pregunta fundamental de esta era: ¿Qué vas a hacer después del fin del mundo? El tema comienza con una irreverente parodia de uno de los diálogos clásicos del pop nacional, para luego dar rienda suelta a un ritmo altamente perreable que da pie a las voces de Amandititita y Fernando, quienes nos hablan de la absurda fragilidad de la vida, de la proliferación de ?expertos? que no tienen idea y de cómo disfrutar del apocalipsis sin renunciar al amor. ?Después del fin del mundo? se estrena este 27 de agosto en todas las plataformas para ponerle sabor a esta cuaretena.  \r\nLETRA: FERNANDO RIVERA CALDERÓN, AMANDA LALENA ESCALANTE / MÚSICA: LEO SOQUI, FERNANDO RIVERA CALDERÓN / BAJO, TECLADOS Y SECUENCIAS: LEO SOQUI / PRODUCCIÓN: LEO SOQUI / MEZCLA: JUAN CUBAS FRIDMAN\r\n', '2020-08-28', '00:23:30', 1, 'DIGITAL', 'Si', NULL, NULL),
