(1402, '7509841318174', 'CDFL-1817', 'CDFL', 'Fadi El Saadi', 'Lamis - Bellydance Vol. 6', '2', '49', '49', 1, 'Si', 'https://open.spotify.com/album/7Ku4VbatPVGkbyVhQWGuzJ?si=gmVqRBCtSOqRnpDwO5Cdmw', 'https://music.apple.com/mx/album/lamis-bellydance-vol-6/1542072803', 'https://www.amazon.com/-/es/Fadi-El-Saadi/dp/B08PMVZWJ4/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=Fadi+El+Saadi+Lamis+-+Bellydance+Vol.+6&qid=1607713264&s=dmusic&sr=1-1', NULL, 'https://music.amazon.com.mx/albums/B08PMVZWJ4', 'https://music.youtube.com/playlist?list=OLAK5uy_kx2Zb8BLuwukWV6L22zepvxPriiEPwhq8', 'https://deezer.page.link/BZiHyk6yiR7L7WCw9', 'https://tidal.com/browse/album/165355262', 'img/caratulas/2020_12_10_08_10_24__7509841318174.jpeg', NULL, NULL, NULL, '2020-12-11', '11:03:00', 1, 'DIGITAL', 'Si', NULL, NULL),
(1403, '7509841318167', 'CDFL-1816', 'DVDF', 'La Barranca', 'Entre la Niebla', '36', '49', '49', 1, 'Si', 'https://open.spotify.com/album/6pOhR6mf1a0NpHrurPmjgk?si=Gp54k9dSQKeTe3BS0xI2bw', 'https://music.apple.com/mx/album/entre-la-niebla/1542284836', 'https://www.amazon.com/-/es/Barranca/dp/B08P6YL83M/ref=sr_1_1?__mk_es_US=%C3%85M%C3%85%C5%BD%C3%95%C3%91&dchild=1&keywords=La+Barranca+Entre+la+Niebla&qid=1607666657&s=dmusic&sr=1-1', NULL, 'https://music.amazon.com.mx/albums/B08P6YL83M', 'https://music.youtube.com/playlist?list=OLAK5uy_lp2AFhUP9EKV3_JlZLFYoZEmltanwpijs', 'https://deezer.page.link/hp2ZjFn9r3c84y6r5', 'https://tidal.com/browse/album/163821926', 'img/caratulas/2020_12_10_08_15_29__7509841318167.jpeg', NULL, 'https://www.youtube.com/watch?v=WvdFe18kQhY', 'LA BARRANCA presenta Entre la Niebla, nueva producción discográfica con música original, diciembre 2020\r\n\r\nA mediados de 2020, ante las restricciones impuestas a la actividad musical de concierto por la pandemia global de COVID 19, la banda mexicana de rock La Barranca enfoca sus energías en la producción de un nuevo álbum de estudio. De esta manera completa una trilogía de producciones discográficas dadas a conocer en el 2020 con dos discos de versiones a piezas de su repertorio: Fragor, un álbum de versiones orquestales arregladas e interpretadas por la Banda Sinfónica de Aguascalientes; y Nocturno, un disco de remixes electrónicos a cargo de DJ Noorbac. Entre la Niebla cierra esta trilogía, y lo hace con 10 temas de música nueva, originales de José Manuel Aguilera.\r\nEntre la Niebla es arreglado y producido por la propia banda y es grabado y mezclado en CDMX por el multi ganador del Grammy Latino, Eduardo Del Águila.\r\n\r\nAunque echa mano de materiales, ideas, fragmentos de canciones e incluso montajes previos, el trabajo de Entre la Niebla inicia formalmente el 14 de abril de 2020. El grueso de la escritura tiene lugar en Valle de Bravo en los meses siguientes, casi en paralelo con el trabajo de arreglos, que se hace a distancia, compartiendo archivos digitalmente. Las bases del disco fueron grabadas en CDMX en la semana del 14 al 18 de septiembre; los pianos el 9 de octubre; instrumentos adicionales y voces se grabaron en los estudios personales de la banda en las semanas siguientes. En ningún punto del proceso estuvieron los cinco integrantes de La Barranca en el mismo espacio físico.\r\n\r\nEl disco ha sido grabado exclusivamente por los cinco integrantes de la banda:\r\n\r\nJosé Manuel Aguilera: voz, guitarra, loops, sintetizadores extra\r\nAdolfo Romero: guitarra, Prophet en Este Amor\r\nErnick Romero: bajo, contrabajo, bajo Moog, coros\r\nYann Zaragoza: piano eléctrico, piano, sintetizadores\r\nAbraham Mendez: batería, percusión\r\n\r\nTeniendo como única invitada la voz de Cecilia Toussaint\r\n\r\nGrabación bases: Eduardo Del Águila, Estudio Chapelle\r\nMezcla: Eduardo Del Águila, Monomix Estudio, CDMX\r\nMaster: Harris Newman, Greymarket Mastering, Montreal\r\n\r\nLa portada de Entre la Niebla está ilustrada con un detalle de la obra Cuerpos Flotantes, del conocido artista plástico Francisco Larios.\r\n\r\n', '2021-09-24', '12:56:41', 1, 'ACTIVO', 'Si', NULL, NULL),
