(1421, '7509841278331', 'CDDP-7833', 'CDDP', 'Carlos Macías & Cristian Castro', 'Lo Que Fuera - Single', '6', '28', '49', 1, 'Si', 'https://open.spotify.com/album/6cExvf8qQZsLHa7AM0JAra?si=L4fG2Hy1S2Cx45Fbvb-WaQ', 'https://music.apple.com/mx/album/lo-que-fuera-single/1553535753', 'https://www.amazon.com/Lo-Que-Fuera/dp/B08WGF455M/ref=sr_1_1?dchild=1&keywords=cristian+castro+lo+que+fuera&qid=1613109897&sr=8-1', NULL, 'https://music.amazon.com/albums/B08WG2WJMG?marketplaceId=ATVPDKIKX0DER&musicTerritory=US', 'https://music.youtube.com/playlist?list=OLAK5uy_k6eyCYoEbNXwyauTvYJiOFdPjS4_tZEmk', 'https://deezer.page.link/gWVDPgAF531cCYXQA', 'https://listen.tidal.com/album/173141097/', 'img/caratulas/2021_02_09_13_56_27__7509841278331.jpeg', NULL, NULL, 'Autor y compositor: Carlos Macías \r\nProductor: Carlos Macías \r\nArreglo: Toño Coutiño\r\nEditora: Expocompositores Publishing \r\n\r\n\r\nLO QUE FUERA\r\n\r\n\r\nHoy me sobra el tiempo\r\nPero no te tengo\r\nLo que diera por comerme \r\ntu mirada con un beso\r\n\r\nHoy que están tan lindas \r\nestas madrugadas\r\nPero no estás tú \r\ny se me han vuelto tan largas\r\n\r\nHoy que ya no hay prisa\r\nY las aves cantan\r\nY este encierro que se ríe \r\nen mi cara a carcajadas\r\n\r\nHoy me debo quedar quieto \r\ny mis alas\r\nse han cortado cuando más \r\nquiero volarlas\r\n\r\nY mi vida, te daría\r\nLo que fuera por volver a hacerte mía\r\nTengo tanto para darte\r\nTengo ansias de tocarte\r\nTengo todo el tiempo para procurarte\r\n\r\nY mi vida, te daría\r\nLo que fuera por volver a hacerte mía\r\nTengo ansias de besarte\r\nTantas ganas de gritarle \r\nAl mundo que sin ti\r\nNo tengo a nadie\r\nTengo a nadie\r\n\r\nHoy que ya no hay prisa\r\nY las aves cantan\r\nY este encierro que se ríe \r\nen mi cara a carcajadas\r\n\r\nHoy me debo quedar quieto \r\ny mis alas \r\nse han cortado cuando más \r\nquiero volarlas\r\n\r\nY mi vida, te daría\r\nLo que fuera por volver a hacerte mía\r\nTengo tanto para darte\r\nTengo ansias de tocarte\r\nTengo todo el tiempo para procurarte\r\n\r\nY mi vida, te daría\r\nLo que fuera por volver a hacerte mía\r\nTengo ansias de besarte\r\nTantas ganas de gritarle \r\nAl mundo que sin ti\r\nNo tengo a nadie\r\n', '2021-03-04', '11:26:33', 1, 'DIGITAL', 'Si', NULL, NULL),
