(1429, '7509841278379', 'CDDP-7837', 'CDDP', 'Iraida Noriega & La Groovy Band', 'Inmensa Manada', '24', '52', '49', 1, 'Si', 'https://open.spotify.com/album/5wpNMQcqZma7yfcEjrD3TW?si=aH7z2LEPT0e18rotpSlQWA', 'https://music.apple.com/mx/album/inmensa-manada/1557964271', 'https://www.amazon.com/Inmensa-Manada-Iraida-Noriega-Groovy/dp/B08YDH558C/ref=sr_1_1?dchild=1&keywords=iraida+noriega+inmensa+manada&qid=1615568269&sr=8-1', NULL, 'https://music.amazon.com/albums/B08YDH558C?marketplaceId=ATVPDKIKX0DER&musicTerritory=US', 'https://music.youtube.com/playlist?list=OLAK5uy_n9UQjkfWJy2D82PpL2WOQCB4ay4-s1CIU', 'https://www.deezer.com/es/album/213328232', 'https://tidal.com/browse/album/176367880', 'img/caratulas/2021_03_11_19_49_27__7509841278379.jpeg', NULL, 'https://www.youtube.com/watch?v=V6yoMGAFjDU', 'En el año 2016, nos encontrábamos grabando el disco PARA LUEGO ES TARDE, que salió bajo el sello de\r\nFonarte en 2017, y al final de las sesiones de grabación, yo propuse hacer una serie de improvisaciones\r\ncolectivas que es la música de este EP. El titulo de este EP, INMENSA MANADA, obedece a que este trabajo encierra mucha de la historia de\r\nLA GROOVY, ya que participan Aarón Cruz, y Chuck Rodriguez,juntos, y que han sido ambos los\r\nbajistas de este andar en distintos momentos.Esta Manuel Mora ,el productor de los primeros dos\r\ndiscos, y se integra a esta historia el jóven y visionario ingeniero y productor David Sosa, diseñando\r\ntodo un concepto sonoro para estas canciones.', '2021-03-12', '08:59:19', 1, 'DIGITAL', 'Si', NULL, NULL),
