(1443, '7509841278720', 'CDDP-7872', 'CDDP', 'Ari Brickman', 'Todo lo Invisible (Original Motion Picture Soundtrack)', '44', '49', '49', 1, 'Si', 'https://open.spotify.com/album/4KgXilqQUpdxqon6nx0pPT?si=eWUT06KiR5WD1HHGUbwWjQ', 'https://music.apple.com/mx/album/todo-lo-invisible-original-motion-picture-soundtrack/1562740269', 'https://www.amazon.com/Invisible-Original-Motion-Picture-Soundtrack/dp/B092YXYK6V/ref=sr_1_1?dchild=1&keywords=ari+brickman+todo+lo+invisible&qid=1619118010&sr=8-1', NULL, 'https://music.amazon.com/albums/B092YXYK6V?marketplaceId=ATVPDKIKX0DER&musicTerritory=US', 'https://music.youtube.com/playlist?list=OLAK5uy_n3FHIU5OiKANKHBPtKghGLmMpRXrklLCA&feature=share', 'https://www.deezer.com/es/album/224064192', 'https://tidal.com/browse/album/181173242', 'img/caratulas/2021_04_22_12_01_36__7509841278720.jpeg', NULL, 'https://www.youtube.com/watch?v=BpXdHHfNUp8', 'Soundtrack de la película \"Todo lo Invisible\"\r\nDirectora: Mariana Chenillo\r\nActores: Bárbara Mori / Ari Brickman / José María de Tavira\r\n¿Quién se quedaría a tu lado si tú ya no fueras el mismo?\r\nTigre Producciones\r\n\r\nTRAILER OFICIAL: https://youtu.be/Q2LjYgIaNQU\r\n\r\nLa intérprete uruguaya afincada en México, Bárbara Mori, vuelve a la cartelera de la gran pantalla con \"Todo lo invisible\", un drama que la actriz protagoniza junto a Ari Brickman, coguionista del film. La película que dirige Mariana Chenillo se presentó en el Festival Internacional de Morelia, y se estrenará en los cines el 22 de Abril distribuido por Cinépolis.\r\n\r\nMori fue nombrada en dos ocasiones actriz mexicana del año en los premios Canacine, la última hace diez años con la película \"Viento en contra\". Desde entonces, la presencia de la intérprete había dejado de ser habitual en los cines. Ahora, la artista vuelve para protagonizar \"Todo lo invisible\" junto a Ari Brickman, José María Torre y Daniela Schmidt. \r\n\r\nEn \"Todo lo invisible\", dirigido por Mariana Chenillo, la actriz de Montevideo se mete en la piel de Marina, la esposa de un dentista que sufre una ceguera repentina tras un accidente de tráfico. \r\n', '2021-04-22', '12:09:17', 1, 'DIGITAL', 'Si', NULL, NULL),
