(1486, '7509841278911', 'CDDP-7891', 'CDDP', 'Colectivo Bunker', 'Live @ Soundtube Studios', '36', '25', '24', 1, 'Si', 'https://open.spotify.com/album/5gh4VWZRQbcxDwfnjGBDah?si=pnbY_uuWREa5MPLDJ47Z3g&dl_branch=1', 'https://music.apple.com/mx/album/live-soundtube-studios/1573092862', 'https://www.amazon.com/Live-Soundtube-Studios-Colectivo-Bunker/dp/B097NR87CK/ref=sr_1_1?dchild=1&keywords=colectivo+bunker+live+%40+soundtube+studios&qid=1624637333&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B097NR87CK?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_lNQW6lCSSJWH5Ctno-8iOiFCE9jYaDlZo&feature=share', 'https://www.deezer.com/es/album/239066242', 'https://listen.tidal.com/album/188504964', 'img/caratulas/2021_06_24_18_21_00__7509841278911.jpeg', NULL, NULL, 'En Colectivo Bunker confluyen trayectorias y gustos musicales diversos.\r\nSu núcleo está conformado por Brent Kimbrough, guitarrista originario de Chicago, con lustros de experiencia en los clubes de Jazz de la ciudad de los vientos; Norman Collazo es un bajista y multinstrumentista virtuoso con una dilatada trayectoria en bandas de Guadalajara. Coché lleva el ritmo en la sangre y le pone su toque a las creaciones del colectivo.\r\nColectivo Bunker es además un espacio abierto a músicos de las más variadas expresiones artísticas. Hemos contado con la colaboración de Tommy Bradford en el Sax, de Jorge ?Cuervo? y Chris Jimenez (Troker) en los teclados y de Maritzio (Pneumus) en el acordeón.\r\nTocamos con el alma? And when We are not waisted we dont play so bad.', '2021-06-25', '09:09:54', 1, 'DIGITAL', 'Si', NULL, NULL),
