(1490, '7509841278935', 'CDDP-7893', 'CDDP', 'Los Músicos de José', 'Dirty Sunday - Single', '52', '24', '49', 1, 'Si', 'https://open.spotify.com/album/1oo2NZgtfmfnja68GzEVDe?si=iQc5-QkhR5uGupFUnk2ksA&dl_branch=1', 'https://music.apple.com/mx/album/dirty-sunday-single/1573093286', 'https://www.amazon.com/Dirty-Sunday-Los-M%C3%BAsicos-Jos%C3%A9/dp/B097NPGPSB/ref=sr_1_1?dchild=1&keywords=dirty+sunday+m%C3%BAsicos&qid=1625808620&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B097NPGPSB?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_lC8UhHshO8EDinVTqs9xkKxQWUBBpmpg4&feature=share', 'https://www.deezer.com/es/album/239014132', 'https://tidal.com/browse/album/188505471', 'img/caratulas/2021_07_08_21_16_38__7509841278935.jpeg', NULL, NULL, 'Incluido en el album Magnetic, es un tema que coquetea con el afrobeat. Una guitarra y bajo marcan de forma constante el groove que predomina en toda la rola. Con influencia de los legendarios del género como Fela Kuti y Antibalas, la sección de metales expone el tema de forma enérgica y rítmica para dar paso a los solos del Saxofon alto, la trompeta y la lira. Un trance colectivo que inunda el lugar donde te encuentres y hará que levantes ese animo del goce. ', '2021-07-08', '22:29:27', 1, 'DIGITAL', 'Si', NULL, NULL),
(1491, '7509841278966', 'CDDP-7896', 'CDDP', 'The PoliSon', 'Whole Lotta Love', '57', '35', '49', 1, 'Si', 'https://open.spotify.com/album/10TVWrbgEiWU8lbCrAWkmN?si=qVjiHmyrSjappXTwoRPNsg&dl_branch=1', 'https://music.apple.com/mx/album/whole-lotta-love-single/1576250964', 'https://www.amazon.com/Whole-Lotta-Love/dp/B098SCMSFL/ref=sr_1_1?dchild=1&keywords=the+polison+whole+lotta&qid=1626445366&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B098S66QJK?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_ncoZfMf8bHDmxVq--9dO39kmxn2Jger60&feature=share', 'https://www.deezer.com/es/album/242553772', 'https://tidal.com/browse/album/190194619', 'img/caratulas/2021_07_15_19_21_34__7509841278966.jpeg', NULL, NULL, ' ?The PoliSon? es un proyecto y concepto creado por Juan Cristóbal Pérez Grobet  y Santiago Ojeda -músicos, arreglistas, productores, quienes se han desarrollado en el ámbito de la cultural musical mexicana a lo largo de más de 35 años-. Durante este tiempo,  Juan Cristóbal y Santiago han colaborado en una gran diversidad de proyectos colectivos, en los cuales la constante ha sido la experimentación musical y la fusión de estilos provenientes de distintas latitudes y tradiciones musicales como el Rock, Son, Jazz, Bolero, Merengue, Trova Yucateca, Bambuco, Chachachá, Mambo y Blues. \r\n?The PoliSon?  Big Band? es un esfuerzo por acercar los universos musicales del Rock y la Salsa, en apariencia distintos, pero que tienen los mismos orígenes creativos: la espontaneidad propia de los espacios urbanos y las manifestaciones populares que les han permitido lograr una extraordinaria riqueza en su ejecución y composición. ?La Orquesta The PoliSon? parte del hecho de que estos dos emblemáticos géneros han dado voz a una gran diversidad de grupos populares, permitiéndoles forjar un sentido identitario y comunitario a lo largo de los años y en distintas geografías y escenarios. Esta propuesta busca recuperar estas tradiciones de creación musical, para reconstruir espacios donde las diferencias sociales y culturales puedan convivir de forma armónica. Sin embargo, la intención no es tan sólo ejecutar ambos géneros, sino profundizar estas expresiones mediante una fusión de canciones y letras icónicas del rock al ritmo afroantillano, y bajo la complejidad de los arreglos que caracterizan a la dotación instrumental de las  grandes bandas. Se trata de un planteamiento original en cuanto a la selección de las canciones y de la fusión de los estilos musicales que reinterpreta con voz propia Sympathy for the Devil (The Rolling Stones), Behind Blue Eyes (The Who), Wrapped Around Your Finger (The Police), Carpet Crawlers (Genesis), Have a Cigar, (Pink Floyd) ?Space Oddity?, (David Bowie) To Love Somebody, (BeeGees), Day Tripper (The Beatles), Whole Lotta Love, (Led Zeppelin) y Pride. (U2).  De esta forma, el proyecto intenta difundir la importancia de la fusión musical como principio generador de encuentros rítmicos, musicales y comunitarios. ', '2021-07-16', '07:24:45', 1, 'DIGITAL', 'Si', NULL, NULL),
