(1498, '7509841279055', 'CDDP-7905', 'CDDP', 'Ana Belén Lavanda', 'Marinero - Single', '6', '22', '49', 1, 'Si', 'https://open.spotify.com/album/1VaoGSbmj1jcGayHYtgydd?si=Lat-lVcgTFqYJ1nubOcgow&dl_branch=1', 'https://music.apple.com/mx/album/marinero-single/1578536770', 'https://www.amazon.com/Marinero/dp/B09BFHTXY2/ref=sr_1_1?dchild=1&keywords=ana+belen+lavanda&qid=1628230206&sr=8-1', NULL, 'https://music.amazon.com.mx/albums/B09BFHSW7D?marketplaceId=ART4WZ8MWBX2Y&musicTerritory=MX', 'https://music.youtube.com/playlist?list=OLAK5uy_mhYlq6lqhMNHsB-P8Bo9hArbJmQei7Ri0&feature=share', 'https://www.deezer.com/es/album/248128622', 'https://listen.tidal.com/album/192541720/', 'img/caratulas/2021_08_05_23_15_13__7509841279055.jpeg', NULL, 'https://www.youtube.com/watch?v=0tiP7sM5A6w', 'Ana Belén Díaz Rueda a.k.a Ana Belén Lavanda es una cantautora mexicana que comenzó a acercarse a la música a los 8 años de edad. Su búsqueda por el instrumento indicado duró media década hasta que encontró el adecuado: el canto.\r\nNo le gusta encasillarse en un solo género, y es por eso que ha hecho dos colaboraciones con Folbae.\r\nAna Belén Lavanda es un proyecto de género pop-folclórico, donde la letra es el enfoque principal como vehículo para transmitir un espectro de emociones, como libertad, tristeza, nostalgia y alegría.\r\nLa lavándula es una planta con muchas propiedades,Ana Belén aspira a que las personas que escuchen su música se sientan como la lavanda le hace sentir:relajada de cuerpo y alma.', '2021-08-05', '23:38:50', 1, 'DIGITAL', 'Si', NULL, NULL),
