(1511, '7509841000123', 'LP-12', 'LP5', 'La Barranca', 'Entre la Niebla - Vinil', '36', '49', '49', 3, 'Si', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2021_09_21_09_39_50__LP-12.jpg', 'img/caratulas/2021_09_21_09_39_50__LP-12.jpg', NULL, 'Presenta en exclusiva el nuevo álbum de la banda mexicana La Barranca, \"Entre La Niebla\", se trata de un vinyl splatter de edición limitada a 500 copias numeradas. Entre la niebla es el duodécimo álbum de estudio del grupo mexicano de rock La Barranca. Este material musical se lanzó el 11 de diciembre de 2020 en plataformas digitales. Es el primer álbum de estudio en el cual participa su más reciente baterista, Abraham Mendoza. En Entre la Niebla se deja lo instrumental y vuelven con 10 canciones inéditas: ?El disco? suena curioso, pero ya lo dije y obviamente ustedes ya lo habían deducido: lo que nos proponemos hacer es un disco, un álbum, aunque dicen que la gente ya no oye discos, que ya no tiene tiempo ni capacidad de atención para oír álbumes completos, sino sólo canciones aisladas. Nosotros estamos pensando en un disco. Justo antes de que iniciara la pandemia nos habíamos juntado ya, en Valle de Bravo, para trabajar en un par de canciones nuevas, bajo la idea vaga de hacer un EP? Pero esos eran planes pre-Covid?, comentó Aguilera.\r\n\r\nLas bases del disco fueron grabadas en la ciudad de México en la semana del 14 al 18 de septiembre. Los pianos se realizaron el 9 de octubre. Mientras que instrumentos adicionales y voces se grabaron en los estudios personales de la banda en las semanas siguientes. En ningún punto del proceso estuvieron los cinco integrantes de La Barranca en el mismo espacio físico.\r\n\r\nPara este material, La Barranca se compone por José Manuel Aguilera, Adolfo y Ernick Romero, Yann Zaragoza y Abraham Mendez, como invitada especial (así como en shows) Cecilia Toussaint. La portada corrió a cargo de Francisco Larios y lo que observamos es la obra llamada Cuerpos Flotantes.\r\n\r\nEl diseño del vinyl fue por Kraken Khan. \r\n\r\nEl álbum cuenta con una duración de 42 minutos distribuidos en 10 canciones totalmente nuevas.\r\n\r\nTrack List:\r\n\r\n01 Sueño de Orquídea\r\n02 Máscara de Relámpago\r\n03 Entre la Niebla I\r\n04 Nada Tiene Paz\r\n05 Pandemónium\r\n06 Sin Temor Ni Esperanza\r\n07 Afrodita\r\n08 Ocaso\r\n09 Este Amor\r\n10 Entre La Niebla II', '2021-09-21', '09:43:43', 1, 'ACTIVO', 'Si', NULL, NULL),
(1512, '7509841000116', 'LP-11', 'LP5', 'La Barranca', 'Rueda de los Tiempos - Vinil', '36', '49', '49', 3, 'Si', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2021_09_27_10_08_44__IMG_6394.JPG', 'img/caratulas/2021_09_21_09_42_36__LP-11.jpg', NULL, 'Rueda de los Tiempos, Reedición 2021 en vinyl de Color Azul, limitada a 200 copias.\r\n\r\nRueda de los tiempos es el tercer álbum de estudio del grupo de rock mexicano La Barranca. Sin duda uno de los trabajos más diversos en cuanto a estilo se refiere de la banda, considerado por ellos como su mejor trabajo a la fecha.\r\n\r\n \r\n\r\n\"Hace 20 años se editó Rueda de los tiempos, tercera placa de La Barranca, álbum que hoy es objeto de una edición en vinil (180 gramos, color azul, edición limitada a 200 copias) vía el Club del Rock & Roll. Es, ahora lo podemos ver, un disco preparatorio para una transición de la agrupación y del cual se han desprendido temas ya clásicos en el repertorio de la misma como ?Caravana?, ?La fuga de Rubén? y ?Llueve?, entre otros.\r\n\r\nA propósito de esta edición, presentamos un track por track, comentado brevemente por José Manuel Aguilera y tomado de mi libro La vida en La Barranca (Ediciones Stella, 2008). \r\n\r\nTrack List:\r\n\r\nA01 Déja Vu\r\nA02 Caravana\r\nA03 Tambor\r\nA04 Paraíso Elemental\r\nA05 Jardín del Tiempo\r\nA06 Prisma\r\nA07 Marte\r\n\r\nB01 La Fuga de Rubén\r\nB02 Llueve\r\nB03 Estallido\r\nB04 Vuelta Interminable\r\nB05 Tórname\r\nB06 Dentro de un Siglo\r\nB07 Bagdad (Bonus Track)', '2022-03-07', '10:11:51', 1, 'INACTIVO', 'Si', NULL, NULL),
(1513, '7509841000109', 'LP-10', 'LP3', 'Monocordio', 'Pájaros y Cuchillos - Vinil', '36', '49', '49', 3, 'No', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'img/caratulas/2021_09_21_10_34_00__LP-10.jpg', 'img/caratulas/2021_09_21_09_53_36__LP-10-2.jpg', NULL, 'Fernando Rivera Calderón, se unió a los hermanos Arreola  (Alonso y Chema) en 2016 para crear el álbum Pájaros y Cuchillos, a lo  que muchos le llamaron \"El trío poderoso\".\r\n\r\nEste álbum en vinyl, edición es limitada a 500 copias, es un LP de 180 gr. color rojo, con inserto. Además el arte corrió a cargo del diseñador Kraken.\r\n\r\nEl álbum contiene 8 tracks inéditos grabados por el reconocido Gerry Rosado. Este álbum marca el regreso a la escena del rock de este proyecto de más de 10 años de trayectoria.\r\nCabe, destacar que es el primer y hasta el momento, único vinyl de la banda.', '2021-09-21', '10:33:46', 1, 'ACTIVO', 'No', NULL, NULL),
