(6, '05', 'TFL2-01', 'TFL2', 'Taza Calaca Negra - Labrada', 1, 0, 0, 0, 'img/caratulas/2017_04_12_11_58_17__CALACA NEGRA OK.jpg', 'img/caratula/muestra.jpg      ', 'Taza Negra con Calaca de Posadas \r\nLabrada', '2020-06-17', '09:31:28', 1, 'INACTIVO'),
(7, '9786079551223', 'LF1-01', 'LF1', 'Sr. González', 7, 0, 0, 0, 'img/caratulas/2017_04_12_11_57_30__LF1-01.jpg', 'img/caratulas/2017_04_12_11_28_43__rafa libro ok.jpg          ', 'El Sr. González tiene una larga trayectoria en el rock nacional mexicano. Forma parte de grupos como Botellita de Jerez y ha colaborado con Café Tacvba, Julieta Venegas, Fratta y Monocordio, entre muchos otros. Es productor de una veintena de discos y promotor férreo de la música independiente con 7 producciones en su haber. Después de librar una difícil lucha contra el cáncer, nos sorprende ahora con \"Mi Vida Pop\", su primer libro.', '2017-04-12', '11:57:21', 1, 'ACTIVO'),
(8, '06', 'TFL2-02', 'TFL2', 'Taza Clave de Fa (For Bass Players) - Negra', 1, 0, 0, 0, 'img/caratulas/2017_04_12_12_01_26__FA NEGRA OK.jpg', 'img/caratula/muestra.jpg    ', 'Taza para bajistas', '2020-06-17', '09:30:59', 1, 'INACTIVO'),
