(11, '9786078039821', 'LF2-01', 'LF2', 'Jose Fors', 7, 0, 0, 0, 'img/caratulas/2017_04_17_09_22_14__LF2-01.jpg', 'img/caratula/muestra.jpg    ', 'La obra pictorica de Jose Fors con textos de Avelina Lesper y Gutierre Aceves Piña e introduccion de Armando Chong. Edicion de lujo en tamaño 22.50 cm x 30.00 cm para coleccionistas.', '2020-08-25', '10:25:30', 1, 'INACTIVO'),
